rk Frederick “Pepper” Adams III, is available for download or update in your WordPress dashboard. New features in 4.6 help you to focus on the important things while feeling more at home.</p>\n<p><iframe width=\'632\' height=\'354\' src=\'https://videopress.com/embed/GbdhpGF3?hd=1\' frameborder=\'0\' allowfullscreen></iframe><script src=\'https://v0.wordpress.com/js/next/videopress-iframe.js?m=1435166243\'></script></p>\n<hr />\n<h2 style=\"text-align: center\">Streamlined Updates</h2>\n<p><img class=\"aligncenter wp-image-4454 size-large\" src=\"https://i0.wp.com/wordpress.org/news/files/2016/08/streamlined-updates.png?resize=632%2C379&#038;ssl=1\" srcset=\"https://i0.wp.com/wordpress.org/news/files/2016/08/streamlined-updates.png?resize=1024%2C614&amp;ssl=1 1024w, https://i0.wp.com/wordpress.org/news/files/2016/08/streamlined-updates.png?resize=300%2C180&amp;ssl=1 300w, https://i0.wp.com/wordpress.org/news/files/2016/08/streamlined-updates.png?resize=768%2C461&amp;ssl=1 768w, https://i0.wp.com/wordpress.org/news/files/2016/08/streamlined-updates.png?w=1264&amp;ssl=1 1264w, https://i0.wp.com/wordpress.org/news/files/2016/08/streamlined-updates.png?w=1896&amp;ssl=1 1896w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></p>\n<p>Don’t lose your place: stay on the same page while you update, install, and delete your plugins and themes.</p>\n<hr />\n<h2 style=\"text-align: center\">Native Fonts</h2>\n<p><img class=\"aligncenter wp-image-4455 size-large\" src=\"https://i2.wp.com/wordpress.org/news/files/2016/08/native-fonts.png?resize=632%2C379&#038;ssl=1\" srcset=\"https://i2.wp.com/wordpress.org/news/files/2016/08/native-fonts.png?resize=1024%2C614&amp;ssl=1 1024w, https://i2.wp.com/wordpress.org/news/files/2016/08/native-fonts.png?resize=300%2C180&amp;ssl=1 300w, https://i2.wp.com/wordpress.org/news/files/2016/08/native-fonts.png?resize=768%2C461&amp;ssl=1 768w, https://i2.wp.com/wordpress.org/news/files/2016/08/native-fonts.png?w=1264&amp;ssl=1 1264w, https://i2.wp.com/wordpress.org/news/files/2016/08/native-fonts.png?w=1896&amp;ssl=1 1896w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></p>\n<p>The WordPress dashboard now takes advantage of the fonts you already have, making it load faster and letting you feel more at home on whatever device you use.</p>\n<hr />\n<h2 style=\"text-align: center\">Editor Improvements</h2>\n<div style=\"float: left;width: 48%;margin: 0\">\n<h3>Inline Link Checker</h3>\n<p><img class=\"aligncenter wp-image-4456 size-full\" src=\"https://i1.wp.com/wordpress.org/news/files/2016/08/inline-link-checker.png?resize=632%2C379&#038;ssl=1\" srcset=\"https://i1.wp.com/wordpress.org/news/files/2016/08/inline-link-checker.png?w=992&amp;ssl=1 992w, https://i1.wp.com/wordpress.org/news/files/2016/08/inline-link-checker.png?resize=300%2C180&amp;ssl=1 300w, https://i1.wp.com/wordpress.org/news/files/2016/08/inline-link-checker.png?resize=768%2C461&amp;ssl=1 768w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></p>\n<p>Ever accidentally made a link to https://wordpress.org/example.org? Now WordPress automatically checks to make sure you didn’t.</p>\n</div>\n<div style=\"float: right;width: 48%;margin: 0\">\n<h3>Content Recovery</h3>\n<p><img class=\"aligncenter wp-image-4457 size-full\" src=\"https://i1.wp.com/wordpress.org/news/files/2016/08/content-recovery.png?resize=632%2C379&#038;ssl=1\" srcset=\"https://i1.wp.com/wordpress.org/news/files/2016/08/content-recovery.png?w=992&amp;ssl=1 992w, https://i1.wp.com/wordpress.org/news/files/2016/08/content-recovery.png?resize=300%2C180&amp;ssl=1 300w, https://i1.wp.com/wordpress.org/news/files/2016/08/content-recovery.png?resize=768%2C461&amp;ssl=1 768w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></p>\n<p>As you type, WordPress saves your content to the browser. Recovering saved content is even easier with WordPress 4.6.</p>\n</div>\n<hr style=\"clear: both\" />\n<h2 style=\"text-align: center\">Under The Hood</h2>\n<h3>Resource Hints</h3>\n<p><a href=\"https://make.wordpress.org/core/2016/07/06/resource-hints-in-4-6/\">Resource hints help browsers</a> decide which resources to fetch and preprocess. WordPress 4.6 adds them automatically for your styles and scripts making your site even faster.</p>\n<h3>Robust Requests</h3>\n<p>The HTTP API now leverages the Requests library, improving HTTP standard support and adding case-insensitive headers, parallel HTTP requests, and support for Internationalized Domain Names.</p>\n<h3><code>WP_Term_Query</code> and <code>WP_Post_Type</code></h3>\n<p>A new <code><a href=\"https://developer.wordpress.org/reference/classes/wp_term_query\">WP_Term_Query</a></code> class adds flexibility to query term information while a new <code><a href=\"https://developer.wordpress.org/reference/classes/wp_post_type\">WP_Post_Type</a></code> object makes interacting with post types more predictable.</p>\n<h3>Meta Registration API</h3>\n<p>The Meta Registration API <a href=\"https://make.wordpress.org/core/2016/07/08/enhancing-register_meta-in-4-6/\">has been expanded</a> to support types, descriptions, and REST API visibility.</p>\n<h3>Translations On Demand</h3>\n<p>WordPress will install and use the newest language packs for your plugins and themes as soon as they’re available from <a href=\"https://translate.wordpress.org/\">WordPress.org’s community of translators</a>.</p>\n<h3>JavaScript Library Updates</h3>\n<p>Masonry 3.3.2, imagesLoaded 3.2.0, MediaElement.js 2.22.0, TinyMCE 4.4.1, and Backbone.js 1.3.3 are bundled.</p>\n<h3>Customizer APIs for Setting Validation and Notifications</h3>\n<p>Settings now have an <a href=\"https://make.wordpress.org/core/2016/07/05/customizer-apis-in-4-6-for-setting-validation-and-notifications/\">API for enforcing validation constraints</a>. Likewise, customizer controls now support notifications, which are used to display validation errors instead of failing silently.</p>\n<h3>Multisite, now faster than ever</h3>\n<p>Cached and comprehensive site queries improve your network admin experience. The addition of <code><a href=\"https://developer.wordpress.org/reference/classes/wp_site_query\">WP_Site_Query</a></code> and <code><a href=\"https://developer.wordpress.org/reference/classes/wp_network_query\">WP_Network_Query</a></code> help craft advanced queries with less effort.</p>\n<hr />\n<h2 style=\"text-align: center\">The Crew</h2>\n<p>This release was led by <a href=\"https://dominikschilling.de/\">Dominik Schilling</a>, backed up by <a href=\"https://www.garthmortensen.com/\">Garth Mortensen</a> as Release Deputy, and with the help of these fine individuals. There are <span style=\"font-weight: 400\">272</span> contributors with props in this release. Pull up some Pepper Adams on your music service of choice, and check out some of their profiles:</p>\n<a href=\"https://profiles.wordpress.org/a5hleyrich\">A5hleyRich</a>, <a href=\"https://profiles.wordpress.org/jorbin\">Aaron Jorbin</a>, <a href=\"https://profiles.wordpress.org/achbed\">achbed</a>, <a href=\"https://profiles.wordpress.org/adamsilverstein\">Adam Silverstein</a>, <a href=\"https://profiles.wordpress.org/adamsoucie\">Adam Soucie</a>, <a href=\"https://profiles.wordpress.org/adrianosilvaferreira\">Adriano Ferreira</a>, <a href=\"https://profiles.wordpress.org/afineman\">afineman</a>, <a href=\"https://profiles.wordpress.org/mrahmadawais\">Ahmad Awais</a>, <a href=\"https://profiles.wordpress.org/aidvu\">aidvu</a>, <a href=\"https://profiles.wordpress.org/akibjorklund\">Aki Bj&#246;rklund</a>, <a href=\"https://profiles.wordpress.org/xknown\">Alex Concha</a>, <a href=\"https://profiles.wordpress.org/xavortm\">Alex Dimitrov</a>, <a href=\"https://profiles.wordpress.org/alexkingorg\">Alex King</a>, <a href=\"https://profiles.wordpress.org/viper007bond\">Alex Mills (Viper007Bond)</a>, <a href=\"https://profiles.wordpress.org/alexvandervegt\">alexvandervegt</a>, <a href=\"https://profi