ress.org/wpfo\">wpfo</a>, <a href=\"https://profiles.wordpress.org/xavivars\">Xavi Ivars</a>, <a href=\"https://profiles.wordpress.org/yoavf\">Yoav Farhi</a>, <a href=\"https://profiles.wordpress.org/tollmanz\">Zack Tollman</a>, and <a href=\"https://profiles.wordpress.org/zakb8\">zakb8</a>.\n<p>&nbsp;</p>\n<p>Special thanks go to <a href=\"https://jerrysarcastic.com/\">Jerry Bates</a> for producing the release video and <a href=\"http://hugobaeta.com/\">Hugo Baeta</a> for providing marketing graphics.</p>\n<p>Finally, thanks to all the community translators who worked on WordPress 4.6. Their efforts make it possible to use WordPress 4.6 in 52 languages. The WordPress 4.6 release video has been captioned into 43 languages.</p>\n<p>If you want to follow along or help out, check out <a href=\"https://make.wordpress.org/\">Make WordPress</a> and our <a href=\"https://make.wordpress.org/core/\">core development blog</a>. Thanks for choosing WordPress. See you soon for version 4.7!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 16 Aug 2016 19:06:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"Dominik Schilling (ocean90)\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"Lorelle on WP: Blame WordPress For the World’s Problems\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"http://lorelle.wordpress.com/?p=14150\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"https://lorelle.wordpress.com/2016/08/11/blame-wordpress-for-the-worlds-problems/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:519:\"Let&#8217;s call this person &#8220;wise&#8221; using air quotes to give you a description of where they come from in life. This &#8220;wise&#8221; person confronted to me at a public event to announce that WordPress was evil and must be destroyed. &#8220;After all,&#8221; he informed me soundly. &#8220;While WordPress says it supports freedom of speech, it [&#8230;]<img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=lorelle.wordpress.com&blog=72&post=14150&subd=lorelle&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 11 Aug 2016 19:12:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Lorelle VanFossen\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"BuddyPress: BuddyPress 2.6.2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=257253\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"https://buddypress.org/2016/08/buddypress-2-6-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:760:\"<p>BuddyPress 2.6.2 is now available. This is a maintenance release that fixes a few bugs introduced in 2.6. For more information, see <a href=\"https://buddypress.trac.wordpress.org/query?milestone=2.6.2\">the 2.6.2 milestone</a> on <a href=\"https://buddypress.trac.wordpress.org/\">BuddyPress Trac</a>.</p>\n<p>Update to BuddyPress 2.6.2 today in your WordPress Dashboard, or by <a href=\"https://wordpress.org/plugins/buddypress/\">downloading from the wordpress.org plugin repository</a>.</p>\n<p>Questions or comments? Check out <a href=\"https://codex.buddypress.org/releases/version-2-6-2/\">2.6.2 changelog</a>, or stop by <a href=\"https://buddypress.org/support/\">our support forums</a> or <a href=\"https://buddypress.trac.wordpress.org/\">Trac</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 04 Aug 2016 23:26:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"David Cavins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"bbPress: bbPress 2.5.10 – Security Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://bbpress.org/?p=176334\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://bbpress.org/blog/2016/07/bbpress-2-5-10-security-release/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1450:\"<p>bbPress 2.5.10 is out, and is a security release for all previous 2.x versions. 2.5.10 includes additional escaping on user display names in places where names &amp; avatars are commonly displayed together.</p>\n<p><em>These changes are internal to bbPress and do not affect any third-party themes or modifications to bbPress template parts. If you are using a third-party theme or template parts, you will inherit these fixes automatically.</em></p>\n<p>If you&#8217;re using any version of bbPress 2.x and have not yet updated, please take a moment to update your bbPress installations to 2.5.10. If you&#8217;re using WordPress&#8217;s built-in updater, it should only take a click or two. If you need help, please reach out in our <a href=\"https://bbpress.org/forums/\">support forums</a> and someone will be happy to assist you.</p>\n<p>These fixes have also been ported over to 2.6, which we continue to run here at bbPress.org and BuddyPress.org.</p>\n<p>Thank you to HackerOne user psych0tr1a for identifying (and <a href=\"https://make.wordpress.org/core/handbook/testing/reporting-security-vulnerabilities/\">responsibly disclosing</a>) these findings to the WordPress security team, who worked to get 2.5.10 out within a few hours from when the original report came in.</p>\n<hr />\n<p>Speaking of bbPress 2.6, we&#8217;re working on refactoring per-forum moderators now, and we&#8217;ll have a beta ready for everyone to try shortly!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 13 Jul 2016 16:06:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"John James Jacoby\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Donncha: WordPress is thirteen!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"http://z9.io/?p=89499890\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://odd.blog/2016/05/27/wordpress-is-thirteen/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1243:\"<p>You could have knocked me over with a feather today when I read <a href=\"https://ma.tt/2016/05/wordpress-is-a-teenager/\">Matt&#8217;s post</a> announcing that WordPress was celebrating a birthday!</p>\n<p>It didn&#8217;t seem so long ago that we were working on b2++, hacking the multiuser bits in and doing all sorts of crazy things with it.</p>\n<p>Now I&#8217;m &#8220;typing&#8221; this on a mobile phone by swiping my finger across a virtual keyboard. Back then the closest to this that I could imagine would be some sort of SMS integration!</p>\n<p>WordPress today is unrecognisable from what it was back then, especially if you use the slick Calypso interface.</p>\n<p>I&#8217;m looking forward to seeing what the next few years bring.</p>\n\n<p><strong>Related Posts</strong><ul><li> <a href=\"https://odd.blog/2013/08/02/like-a-dog-and-his-ball/\" rel=\"bookmark\" title=\"Permanent Link: Like a dog and his ball\">Like a dog and his ball</a></li><li> <a href=\"https://odd.blog/2009/01/28/wordpress-mu-27/\" rel=\"bookmark\" title=\"Permanent Link: WordPress MU 2.7\">WordPress MU 2.7</a></li><li> <a href=\"https://odd.blog/2008/09/02/wordpress-mu-261/\" rel=\"bookmark\" title=\"Permanent Link: WordPress MU 2.6.1\">WordPress MU 2.6.1</a></li></ul></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 27 May 2016 22:57:38 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"Donncha\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"Akismet: Akismet WordPress Plugin 3.1.11\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.akismet.com/?p=1911\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://blog.akismet.com/2016/05/12/akismet-wordpress-plugin-3-1-11/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1595:\"<p>Version 3.1.11 of <a href=\"http://wordpress.org/plugins/akismet/\">the Akismet plugin for WordPress</a> is now available.</p>\n<p>For a full list of the changes in this release, see the <a href=\"https://plugins.trac.wordpress.org/log/akismet/trunk?action=stop_on_copy&mode=stop_on_copy&rev=1415825&stop_rev=1390588+&limit=100&sfp_email=&sfph_mail=\">revision log</a>, but here are the highlights:</p>\n<ul>\n<li>A bug that could cause the &#8220;Check for Spam&#8221; button to skip some comments has been fixed.</li>\n<li>A bug that could prevent some spam submissions from being sent to Akismet has been fixed.</li>\n<li>All links in the plugin have been updated to use <code>https://</code> whenever possible.</li>\n<li>Akismet won&#8217;t log debug information unless both <code>WP_DEBUG</code> and <code>WP_DEBUG_LOG</code> are enabled. Previously, if only <code>WP_DEBUG_LOG</code> was enabled, Akismet would still (incorrectly) log debug information.</li>\n</ul>\n<p>To upgrade, visit the Updates page of your WordPress dashboard and follow the instructions. If you need to download the plugin zip file directly, links to all versions are available in <a href=\"http://wordpress.org/plugins/akismet/\">the WordPress plugins directory</a>.</p><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/akismet.wordpress.com/1911/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/akismet.wordpress.com/1911/\" /></a> <img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=blog.akismet.com&blog=116920&post=1911&subd=akismet&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 12 May 2016 18:12:35 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Christopher Finke\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"Lorelle on WP: WordPress School: Copyright Policy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"http://lorelle.wordpress.com/?p=14119\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"https://lorelle.wordpress.com/2016/05/10/wordpress-school-copyright-policy/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:515:\"We’ve started our mini-series on adding policies to your WordPress site with some basic information and details on how to organize and structure policies on your site. It’s time to evaluate the five different policies featured on almost all websites regardless of topic or goals in Lorelle&#8217;s WordPress School free online course. Remember, we add [&#8230;]<img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=lorelle.wordpress.com&blog=72&post=14119&subd=lorelle&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 10 May 2016 19:55:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Lorelle VanFossen\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"bbPress: bbPress 2.5.9 – Security &amp; Bugfix Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"https://bbpress.org/?p=174466\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"https://bbpress.org/blog/2016/05/bbpress-2-5-9/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1122:\"<p>bbPress 2.5.9 is out, and is a <strong>security release</strong> for all previous 2.x versions.</p>\n<p>bbPress versions 2.5.8 and earlier are susceptible to a form of cross-site-scripting, due to the way users are linked to their profiles when they are mentioned in topics and replies.</p>\n<p>If you&#8217;re using any version of bbPress 2.x and have not yet updated, please take a moment to update your bbPress installations to 2.5.9. If you&#8217;re using WordPress&#8217;s built-in updater, it should only take a click or two. If you need help, please reach out in our <a href=\"https://bbpress.org/forums/\">support forums</a> and someone will be happy to assist you.</p>\n<p>Thank you to Marc-Alexandre Montpas for identifying (and <a href=\"https://make.wordpress.org/core/handbook/testing/reporting-security-vulnerabilities/\">responsibly disclosing</a>) his findings to the WordPress security team. Everyone involved worked diligently to get 2.5.9 out as quickly as possible.</p>\n<p>These fixes have also been ported over to bbPress 2.6, which we continue to run here at bbPress.org and BuddyPress.org.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 02 May 2016 13:24:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"John James Jacoby\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"Joseph: Trying Out The Twenty Sixteen Theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://josephscott.org/?p=15135\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://blog.josephscott.org/2016/02/10/trying-out-the-twenty-sixteen-theme/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:547:\"<p>Switched to the <a href=\"https://wordpress.org/themes/twentysixteen/\">Twenty Sixteen WordPress Theme</a>.</p>\n<p><a href=\"https://blog.josephscott.org/wp-content/uploads/2016/02/twentysixteen-screenshot-1.png\" rel=\"attachment wp-att-15136\"><img src=\"https://blog.josephscott.org/wp-content/uploads/2016/02/twentysixteen-screenshot-1-1024x768.png\" alt=\"twentysixteen-screenshot\" width=\"840\" height=\"630\" class=\"aligncenter size-large wp-image-15136\" /></a></p>\n<p>I opted to remove the sidebar, to give more focus on the content of the page.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 10 Feb 2016 18:11:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"josephscott\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:104:\"Dougal Campbell: Underscores Components – Custom starter themes for faster WordPress theme development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"http://dougal.gunters.org/?p=81112\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:126:\"http://dougal.gunters.org/blog/2016/02/04/underscores-components-custom-starter-themes-for-faster-wordpress-theme-development/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:658:\"<p><i>&#8220;Components is a library of shareable, reusable patterns for WordPress themes. Instead of starting from scratch, mix and match from a collection of pre-made components to build your own custom starter theme.&#8221; Online tool from Automattic which can generate a variety of starter themes based on Underscores and Components, ready for you to customize.</i></p>\n<p><a href=\"http://components.underscores.me/\">Underscores Components – Custom starter themes for faster WordPress theme development</a></p>\n<div class=\"yarpp-related-rss yarpp-related-none\">\n<img src=\"http://yarpp.org/pixels/5db43ee24c4f1e1d0e45d08cc91b0130\" alt=\"YARPP\" />\n</div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 04 Feb 2016 19:25:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Dougal Campbell\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Dougal Campbell: WordPress, PHP7, and Updates via php-ssh2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"http://dougal.gunters.org/?p=81089\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"http://dougal.gunters.org/blog/2016/01/18/wordpress-php7-and-updates-via-php-ssh2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3919:\"<p>TL;DR: If you use the php-ssh2 extension for your WordPress core / theme / plugin updates, you might want to wait a little longer before upgrading to PHP 7.</p>\n<p>Last month, one of my VPS servers suffered a catastrophic disk failure, taking down several personal websites that my wife and I manage. All of our WordPress content is on a separate database server, so the main content is still intact. I&#8217;ve also been able to extract a <em>few</em> things from a raw image of the damaged drive.  But there were some things (site-specific plugins, child-themes, media content, utility scripts, my email archives) which are likely gone for good, or that will at least be painful to put back into place (uploaded images, etc.).</p>\n<p>There&#8217;s not much use crying over spilt milk, though, so I at least saw this as an opportunity to freshen up and improve upon my previous server configuration. In its previous incarnation, I had been running Apache workers, and PHP-FPM (PHP 5.6.x). But I also had some web experiments in Nodejs, which I had to run on a non-standard port, so as to not conflict with Apache. Since I was starting from scratch anyways, I&#8217;ve decided to put HAProxy in front of everything, so that I can internally run multiple web servers, and just proxy to them transparently. And while I was at it, I&#8217;ve been hearing a lot of good things about the speed improvements in PHP 7, so I figured I&#8217;d upgrade that, as well.</p>\n<p>I won&#8217;t go into the nitty-gritty details of my install (especially since I&#8217;m not finished yet), but I did want to let others know about a problem I&#8217;ve run into: There is a new development build of the php-ssh2 extension for PHP 7, but it is not quite complete yet. Many things do work, but unfortunately, all of the functions which rely on the ability to use the <code>stat()</code> call are broken at this time. This includes other file-checking functions such as <code>is_dir()</code>, and <code>is_file()</code>, <code>file_exists()</code>. In WordPress, if you are using the SSH2 filesystem class (rather than FTP or FTPS), this will prevent you from using the built-in plugin and theme installers, or any of the automatic upgrade functionality.</p>\n<p>After digging around in the php-ssh2 extension source code for a while and comparing to a previous version, I was unable to find the problem myself. My C programming is too rusty, and I just don&#8217;t have the time to start learning PHP and libssh2 internals from scratch. But, I did <a href=\"https://bugs.php.net/bug.php?id=71376\">file a bug on the PHP Bugtracker</a>, and the author of the PHP 7 port of the php-ssh2 extension has said that he is working on a fix. So keep an out out for an update on that.</p>\n<p>Just as a side-note, using fstat() on a filehandle opened on an ssh2.sftp file resource, or using the ssh2_sftp_stat() call do work. But that doesn&#8217;t help with the is_dir() and is_file() calls which are failing in the class-wp-filesystem-ssh2.php code. Those functions rely on the PHP internal ssh2.sftp stream wrappers.</p>\n<p>Postscript: I know plenty of people will say, &#8220;You should have had backups!&#8221; or even, &#8220;Your VPS host must suck for not having backups!&#8221;. The former is absolutely true &#8212; I should have done better at backing up some of the things that I did not have backups for. The VPS host is not really to blame. I had gotten a disk size upgrade, and I actually had an opportunity to request a snapshot of my system before I ran the upgrade process to extend my disk. But because I had run it successfully on another server without incident, I got careless. And after the upgrade, the system seemed to run fine for about three weeks before any problems surfaced.</p>\n<div class=\"yarpp-related-rss yarpp-related-none\">\n<img src=\"http://yarpp.org/pixels/5db43ee24c4f1e1d0e45d08cc91b0130\" alt=\"YARPP\" />\n</div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 18 Jan 2016 18:14:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Dougal Campbell\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"Donncha: The Web Won’t Forget Alex King\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"http://z9.io/?p=89499737\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://odd.blog/2015/09/29/the-web-wont-forget-alex-king/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2823:\"<p>If you use a WordPress site, either as a visitor or owner, you&#8217;re using code that <a href=\"http://alexking.org/\">Alex King</a>, one of the original developers of WordPress, worked on. </p>\n<p>He passed away after fighting <a href=\"http://alexking.org/blog/thread/cancer\">cancer for 2 years</a> but his online presence lives on in the form of his blog with it&#8217;s deep archive of posts going back years, and in so much code that it&#8217;s humbling to look at his <a href=\"http://alexking.org/projects\">projects page</a>. Looking through the svn log of WordPress trunk shows he still had a hand in helping the WordPress project until relatively recently:</p>\n<blockquote><p>trunk$ svn log|grep alexkingorg<br />\nprops alexkingorg for the initial, long-suffering patch.<br />\nprops alexkingorg. fixes <a href=\"https://core.trac.wordpress.org/ticket/24162\">#24162</a>.<br />\nProps alexkingorg<br />\n`wp.media` instead of just `media`. props alexkingorg, see #22676.<br />\nAdd $post_ID context to the pre_ping filter. props alexkingorg, devesine. fixes #18506.<br />\nAdd filter so the users can select custom image sizes added by themes and plugins, props alexkingorg, fixes #18520<br />\nesc_textarea() and application for obvious textarea escaping. props alexkingorg. fixes #15454<br />\nEscape links by default.  Props alexkingorg. see #13051<br />\nSafely include class-json.php, class-simplepie.php and class-snoopy.php, props alexkingorg, fixes #11827<br />\nFix user creation from admin after changes for #10751. Fixes #10811 props alexkingorg.<br />\nHooks needed to allow alternate category admin inteface. Props alexkingorg. fixes #3408<br />\nWrap cat name in CDATA. props alexkingorg.  fixes #3252</p></blockquote>\n<p>I&#8217;m sorry I never met Alex, however I remember working virtually with him and Adam Tow on AllThingsD which seems like a lifetime away now. Adam has <a href=\"http://tow.com/2015/09/28/remembering-alex-king/\">a great article</a> on Alex on his blog, as does Matt <a href=\"http://ma.tt/2015/09/remembering-alex-king/\">who went into detail</a> about Alex&#8217;s involvement with WordPress going back to the days of b2. I had completely forgotten <a href=\"http://alexking.org/blog/2004/01/25/wordpress-css-style-competition\">the CSS competition</a> he mentioned!</p>\n<p>Alex, your legacy lives on. </p>\n\n<p><strong>Related Posts</strong><ul><li> <a href=\"https://odd.blog/2003/03/10/b2-hacks/\" rel=\"bookmark\" title=\"Permanent Link: b2 Hacks\">b2 Hacks</a></li><li> <a href=\"https://odd.blog/2007/12/12/how-to-find-cocaine-in-ireland/\" rel=\"bookmark\" title=\"Permanent Link: How to find cocaine in Ireland\">How to find cocaine in Ireland</a></li><li> <a href=\"https://odd.blog/2003/05/31/king-of-hearts/\" rel=\"bookmark\" title=\"Permanent Link: King Of Hearts\">King Of Hearts</a></li></ul></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 29 Sep 2015 20:44:12 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"Donncha\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Joseph: Recommended Consultants\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://josephscott.org/?p=9888\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://blog.josephscott.org/2015/07/22/recommended-consultants/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:277:\"<p>My personal list of WordPress consultants has dried up ( some took full time jobs, the rest are always booked solid ).  Now I&#8217;m directing people to the <a href=\"http://jkudish.com/recommendations/\">Recommended Consultants &amp; Resources list</a> from Joey Kudish.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 22 Jul 2015 14:01:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"josephscott\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"Andrew Nacin: Smarter algorithms, smarter defaults\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"http://nacin.com/?p=4329\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://nacin.com/2015/05/24/smart-algorithms-defaults/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:757:\"<blockquote><p>Instead of showing the user an alert that something might not work, maybe we can build a smarter algorithm. Instead of asking the user to make a choice up front, maybe we can set a smart default and see if there is high demand after launch for more customization.</p></blockquote>\n<p>— <a href=\"http://www.rebeccarolfe.com/\">Rebecca Rolfe</a> on the Google Chrome team, interviewed in <a href=\"http://www.refinery29.com/female-white-hat-hackers-google-chrome\">The Badass Women of Chrome&#8217;s Security Team</a> in Refinery29.</p>\n<p>(More on making <a href=\"http://nacin.com/2011/12/18/in-open-source-learn-to-decide/\">decisions</a>, <a href=\"http://nacin.com/2013/07/01/firefox-makes-a-decision-removes-an-option/\">not options</a>.)</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 24 May 2015 23:11:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Andrew Nacin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"Mark Jaquith: Tips for Hosting WordPress on Pantheon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"http://markjaquith.wordpress.com/?p=5186\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://markjaquith.wordpress.com/2015/04/13/wordpress-on-pantheon/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:8780:\"<p><a href=\"https://pantheon.io/\">Pantheon</a> has long been hosting Drupal sites, and their entry into the WordPress hosting marketplace is quite welcome. For the most part, hosting WordPress sites on Pantheon is a dream for developers. Their command line tools and git-based development deployments, and automatic dev, test, live environments (with the ability to have multiple dev environments on some tiers) are powerful things. If you can justify the expense (and they&#8217;re not cheap), I would encourage you to check them out.</p>\n<p>First, the good stuff:</p>\n<h2>Git-powered dev deployments</h2>\n<p>This is great. Just add their Git repo as a remote (you can still host your code on GitHub or Bitbucket or anywhere else you like), and deploying to dev is as simple as:</p>\n<pre class=\"brush: plain; light: true; title: ; notranslate\">git push pantheon-dev master</pre>\n<h2>Command-line deployment to test and live</h2>\n<p>Pantheon has a CLI tool called <a href=\"https://github.com/pantheon-systems/cli\">Terminus</a> that can be used to issue commands to Pantheon (including giving you access to remote WP-CLI usage).</p>\n<p>You can do stuff like deploy from dev to test:</p>\n<pre class=\"brush: plain; light: true; title: ; notranslate\">terminus site deploy --site=YOURSITE --env=test --from=dev --cc</pre>\n<p>Or from test to live:</p>\n<pre class=\"brush: plain; light: true; title: ; notranslate\">terminus site deploy --site=YOURSITE --env=live --from=test</pre>\n<p>Clear out Redis:</p>\n<pre class=\"brush: plain; light: true; title: ; notranslate\">terminus site redis clear --site=YOURSITE --env=YOURENV</pre>\n<p>Clear out Varnish:</p>\n<pre class=\"brush: plain; light: true; title: ; notranslate\">terminus site clear-caches --site=YOURSITE --env=YOURENV</pre>\n<p>Run WP-CLI commands:</p>\n<pre class=\"brush: plain; light: true; title: ; notranslate\">terminus wp option get blogname --site=YOURSITE --env=YOURENV</pre>\n<h2>Keep dev and test databases &amp; uploads fresh</h2>\n<p>When you&#8217;re developing in dev or testing code in test before it goes to live, you&#8217;ll want to make sure things work with the latest live data. On Pantheon, you can just go to <strong>Workflow</strong> &gt; <strong>Clone</strong>, and easily clone the database and uploads (called &#8220;files&#8221; on Pantheon) from live to test or dev, complete with rewriting of URLs as appropriate in the database.</p>\n<h2>No caching plugins</h2>\n<p>You can get rid of Batcache, W3 Total Cache, or WP Super Cache. You don&#8217;t need them. Pantheon caches pages outside of WordPress using Varnish. It just works (including invalidating URLs when you publish new content). But what if you want some control? Well, that’s easy. Just issue standard HTTP cache control headers, and Varnish will obey.</p>\n<pre class=\"brush: php; title: ; notranslate\">\n&lt;?php\n\nfunction my_pantheon_varnish_caching() {\n	if ( is_user_logged_in() ) {\n		return;\n	}\n	$age = false;\n\n	// Home page: 30 minutes\n	if ( is_home() &amp;&amp; get_query_var( \'paged\' ) &lt; 2 ) {\n		$age = 30;\n	// Product pages: two hours\n	} elseif ( function_exists( \'is_product\' ) &amp;&amp; is_product() ) {\n		$age = 120;\n	}\n\n	if ( $age !== false ) {\n		pantheon_varnish_max_age( $age );\n	}\n}\n\nfunction pantheon_varnish_max_age( $minutes ) {\n	$seconds = absint( $minutes ) * 60;\n	header( \'Cache-Control: public, max-age=\' . $seconds );\n}\n\nadd_action( \'template_redirect\', \'my_pantheon_varnish_caching\' );\n</pre>\n<p>And now, some unclear stuff:</p>\n<h2>Special wp-config.php setup</h2>\n<p>Some things just aren&#8217;t very clear in Pantheon&#8217;s documentation, and using Redis for object caching is one of them. You&#8217;ll have to do a bit of work to set this up. First, you&#8217;ll want to download the <a href=\"https://wordpress.org/plugins/wp-redis/\">wp-redis</a> plugin and put its <strong>object-cache.php</strong> file into <strong>/wp-content/</strong>.</p>\n<p><strong>Update</strong>: apparently this next step is <a href=\"https://github.com/pantheon-systems/wp-redis/blob/798af584f7470dafa5f9c2221a3cc3a89b5058b3/object-cache.php#L701-L704\">not needed</a>!</p>\n<p>Next, modify your <strong>wp-config.php</strong> with this:</p>\n<pre class=\"brush: php; title: ; notranslate\">\n// Redis\nif ( isset( $_ENV[\'CACHE_HOST\'] ) ) {\n	$GLOBALS[\'redis_server\'] = array(\n		\'host\' =&gt; $_ENV[\'CACHE_HOST\'],\n		\'port\' =&gt; $_ENV[\'CACHE_PORT\'],\n		\'auth\' =&gt; $_ENV[\'CACHE_PASSWORD\'],\n	);\n}\n</pre>\n<p>Boom. Now Redis is now automatically configured on all your environments!</p>\n<p>Setting <strong>home</strong> and <b>siteurl</b> based on the HTTP Host header is also a nice trick for getting all your environments to play, but beware yes-www and no-www issues. So as to not break WordPress&#8217; redirection between those variants, you should massage the Host to not be solidified as the one you don&#8217;t want:</p>\n<pre class=\"brush: php; title: ; notranslate\">\n// For non-www domains, remove leading www\n$site_server = preg_replace( \'#^www\\.#\', \'\', $_SERVER[\'HTTP_HOST\'] );\n\n// You\'re on your own for the yes-www version <span class=\"wp-smiley wp-emoji wp-emoji-smile\" title=\":-)\">:-)</span>\n\n// Set URLs\ndefine( \'WP_HOME\', \'http://\'. $site_server );\ndefine( \'WP_SITEURL\', \'http://\'. $site_server );\n\n</pre>\n<p>So, those environment variables are pretty cool, huh? There are more:</p>\n<pre class=\"brush: php; title: ; notranslate\">\n// Database\ndefine( \'DB_NAME\', $_ENV[\'DB_NAME\'] );\ndefine( \'DB_USER\', $_ENV[\'DB_USER\'] );\ndefine( \'DB_PASSWORD\', $_ENV[\'DB_PASSWORD\'] );\ndefine( \'DB_HOST\', $_ENV[\'DB_HOST\'] . \':\' . $_ENV[\'DB_PORT\'] );\n\n// Keys\ndefine( \'AUTH_KEY\', $_ENV[\'AUTH_KEY\'] );\ndefine( \'SECURE_AUTH_KEY\', $_ENV[\'SECURE_AUTH_KEY\'] );\ndefine( \'LOGGED_IN_KEY\', $_ENV[\'LOGGED_IN_KEY\'] );\ndefine( \'NONCE_KEY\', $_ENV[\'NONCE_KEY\'] );\n\n// Salts\ndefine( \'AUTH_SALT\', $_ENV[\'AUTH_SALT\'] );\ndefine( \'SECURE_AUTH_SALT\', $_ENV[\'SECURE_AUTH_SALT\'] );\ndefine( \'LOGGED_IN_SALT\', $_ENV[\'LOGGED_IN_SALT\'] );\ndefine( \'NONCE_SALT\', $_ENV[\'NONCE_SALT\'] );\n</pre>\n<p>That’s right — you don&#8217;t need to hardcode those values into your <strong>wp-config</strong>. Let Pantheon fill them in (appropriate for each environment) for you!</p>\n<p>And now, some gotchas:</p>\n<h2>Lots of uploads = lots of problems</h2>\n<p>Pantheon has a distributed filesystem. This makes it trivial for them to scale your site up by adding more Linux containers. But their filesystem does <strong>not</strong> like directories with a lot of files. So, let&#8217;s consider the WordPress uploads folder. Usually this is partitioned by month. On Pantheon, if you start approaching 10,000 files in a directory, you&#8217;re going to have problems. Keep in mind that crops count towards this limit. So one upload with 9 crops is 10 files. 1000 uploads like that in a month and you&#8217;re in trouble. I would recommend splitting uploads by <strong>day</strong> instead, so the Pantheon filesystem isn&#8217;t strained. A <a href=\"https://wordpress.org/plugins/custom-upload-dir/\">plugin like this</a> can help you do that.</p>\n<h2>Sometimes notices cause segfaults</h2>\n<p>I honestly don&#8217;t know what is going on here, but I&#8217;ve seen <strong>E_NOTICE</strong> errors cause PHP segfaults. Being segfaults, they produce no useful information in logs, and I&#8217;ve had to spend hours tracking down the code causing the issue. This happens reliably for given code paths, but I don&#8217;t have a reproducible example. It’s just weird. I have a ticket open with Pantheon about this. It’s something in their custom error handling. Until they get this fixed, I suggest doing something like this, in the first line of <strong>wp-config.php</strong>:</p>\n<pre class=\"brush: php; title: ; notranslate\">\n// Disable Pantheon\'s error handler, which causes segfaults\nfunction disable_pantheon_error_handler() {\n	// Does nothing\n}\n\nif ( isset( $_ENV[\'PANTHEON_ENVIRONMENT\'] ) ) {\n	set_error_handler( \'disable_pantheon_error_handler\' );\n}\n</pre>\n<p>This just sets a low level error handler that stops errors from bubbling up to PHP core, where the trouble likely lies. You can still use something like <a href=\"https://wordpress.org/plugins/debug-bar/\">Debug Bar</a> to show errors, or you could modify that blank error handler to write out to an error log file.</p>\n<h2>Have your own tips?</h2>\n<p>Do you have any tips for hosting WordPress on Pantheon? Let me know in the comments!</p><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/markjaquith.wordpress.com/5186/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/markjaquith.wordpress.com/5186/\" /></a> <img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=markjaquith.wordpress.com&blog=316&post=5186&subd=markjaquith&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 14 Apr 2015 02:08:24 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Mark Jaquith\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"Andrew Nacin: I’ve joined the White House’s U.S. Digital Service\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"http://nacin.com/?p=4297\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"https://nacin.com/2015/03/29/us-digital-service/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5753:\"<blockquote><p>The need for effective government services is rising, while confidence in our ability to deliver them is dropping. More than ever, day-to-day interactions with government are powered by digital systems, and yet far too many Federal IT projects arrive late or over budget. Others are simply abandoned. These failures are often felt by those who count on it most — working class Americans and people who turn to government in a moment of need.<br />\n<cite>The U.S. Digital Service on <a href=\"https://www.whitehouse.gov/digital/united-states-digital-service/story\">whitehouse.gov</a></cite></p></blockquote>\n<p>When you&#8217;re presented with an opportunity to help transform how the federal government works for the American people, it&#8217;s really hard to say no.</p>\n<p>For five years and counting, I&#8217;ve had the honor and privilege as a lead developer of WordPress to play a role in a large, incredible movement to democratize publishing. From my home in D.C., I&#8217;ve closely watched <a href=\"http://www.data.gov/\">open data</a> and <a href=\"https://m.whitehouse.gov/blog/2014/06/02/ostp-s-own-open-government-plan\">open government efforts</a>. <a href=\"http://nacin.com/2014/03/24/an-hour-to-make-government-better/\">I feel very strongly</a> about an open, transparent, and efficient government — boosted in no small part by WordPress and open source.</p>\n<p>I&#8217;ve long admired a number of my new teammates, especially <a href=\"http://www.nextgov.com/cio-briefing/2015/03/meet-digital-service-guru-whos-helping-new-recruits-navigate-federal-bureaucracy/107148/\">Erie Meyer</a>, <a href=\"http://apieconomist.com/blog/2013/4/10/6h6gntzp6twfuw4zwrzu0j43u0o80p\">Gray Brooks</a>, and <a href=\"http://fcw.com/articles/2014/12/02/getting-started-at-usds.aspx\">Haley van Dyck</a>, for years of tenacity and hard work trying to change government from the inside out. <span>I&#8217;ve always felt I could be more effective helping government from the outside, by continuing to work on WordPress. </span><span>After all, we&#8217;ve all heard horror </span><span>stories of all sorts of red tape, from hiring to procurement and everything in between. And we&#8217;ve all heard how difficult government itself makes it to launch good government digital services. While many of us may have have wanted to help, few thought they could. Fewer knew how.</span></p>\n<p>But then the U.S. Digital Service was formed, from <a href=\"http://wired.com/2014/08/healthcare-gov/\">the team that helped rescue healthcare.gov</a>. It&#8217;s dedicated to tackling some of government&#8217;s most pressing problems, ones that directly affect millions of people&#8217;s lives.<strong> </strong>The formula is simple: take what helped turn around healthcare.gov and <a href=\"http://playbook.cio.gov\">apply it</a> to other high priority projects across government.</p>\n<p>In this day and age, public policy must be backed by effective technology to succeed. The American people need our help and our government has asked us to serve, as <a href=\"https://www.usds.gov/\">doers and makers, creative thinkers, and specialized technologists dedicated to untangling, rewiring, and redesigning our government</a>.</p>\n<p>In January, I joined the U.S. Digital Service.</p>\n<p>When I was approached, I have to admit that I was nervous to step back from the day-to-day buzz of WordPress because I&#8217;ve invested so much. But the community stepped up, in most cases not even knowing about my life change. That&#8217;s the beauty of open source, and the fantastic WordPress community in particular. WordPress continues to play an important role in my life. With <a href=\"http://ma.tt/\">Matt Mullenweg</a>’s support and encouragement, I&#8217;m taking time away from Audrey, where I&#8217;ve worked since 2010. I&#8217;m still actively involved in the project, just not full time.</p>\n<p>The U.S. Digital Service is the real deal. I&#8217;ve been astounded by the impact we&#8217;ve already made. We&#8217;ve recruited <a href=\"https://www.whitehouse.gov/blog/2015/03/19/president-obama-names-david-recordon-director-white-house-information-technology\">some</a> <a href=\"http://www.washingtonpost.com/blogs/the-switch/wp/2014/09/04/white-house-names-googles-megan-smith-the-next-chief-technology-officer-of-the-united-states/\">of</a> <a href=\"https://www.whitehouse.gov/blog/2014/08/20/day-one-mikey-dickerson-us-digital-service-administrator\">the</a> <a href=\"https://www.whitehouse.gov/blog/2015/02/18/white-house-names-dr-dj-patil-first-us-chief-data-scientist\">best</a> <a href=\"https://www.whitehouse.gov/blog/2015/02/05/next-us-chief-information-officer\">and</a> <a href=\"https://medium.com/@USDigitalService/why-i-joined-the-u-s-digital-service-24c6682afce2?source=latest\">brightest</a>. Don&#8217;t just take my word for it — do what you can to <a href=\"https://medium.com/@USDigitalService/mikey-dickerson-to-sxsw-why-we-need-you-in-government-f31dab3263a0\">learn more about this movement</a> and <a href=\"http://www.usds.gov/\">come help us make government better</a>. If you haven&#8217;t seen the video below yet, take a look. (A few of you have noticed me in the background.)</p>\n<p>It&#8217;s my nature to look for the hardest problems to solve. I like to take on big challenges and spend every ounce of energy working to solve them. I believe in what we&#8217;re doing here. The stakes are high. No matter the challenge, I know what we&#8217;re doing will change millions of lives.</p>\n<p>I thought I had made the most of my decade in D.C. I&#8217;ve witnessed a lot of history. I knew I&#8217;d have some great stories to tell my future kids and grandkids. <em>I was there. I saw it.</em> That was only the beginning.</p>\n<p></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 29 Mar 2015 17:25:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Andrew Nacin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"Mark Jaquith: Introducing Cache Buddy: a companion for your WordPress page caching solution\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"http://markjaquith.wordpress.com/?p=5172\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://markjaquith.wordpress.com/2015/03/27/cache-buddy/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6951:\"<p>WordPress is, by default, completely dynamic. On every page load, a bunch of &#8220;work&#8221; happens. Cookies are read. A database is queried. Content is transformed. All of this makes WordPress very powerful and flexible. But for sites that get a lot of traffic and mostly just need to crank out the same pages for everyone, this dynamic nature can become a challenge.</p>\n<p>The common solution to this is to layer a page cache on top of WordPress. <a title=\"View the Batcache WordPress plugin\" href=\"https://wordpress.org/plugins/batcache/\">Batcache</a>, <a title=\"View the W3 Total Cache WordPress Plugin\" href=\"https://wordpress.org/plugins/w3-total-cache/\">W3 Total Cache</a>, and <a title=\"View the WP Super Cache WordPress plugin\" href=\"https://wordpress.org/plugins/wp-super-cache/\">WP Super Cache</a> are examples of page caches built as WordPress plugins. <a href=\"https://www.varnish-cache.org\">Varnish</a>, <a href=\"http://nginx.org/en/docs/http/ngx_http_fastcgi_module.html\">Nginx fastcgi caching</a>, and CDNs like <a href=\"http://www.akamai.com\">Akamai</a> or <a href=\"https://www.cloudflare.com\">Cloudflare</a> are examples of page caching that happens outside of the WordPress layer. They store the HTML that WordPress generates for a given URL and then store it for later, so that when people request that URL in the future, they can just get the cached version, for little or no work on WordPress&#8217; part.</p>\n<p>But these page caching solutions all share the same downside: they can&#8217;t cache pages for logged-in WordPress users or users with WordPress comment cookies. Why not? Well, because WordPress looks at these cookies and alters the page based on them. A logged in user will see the WordPress toolbar at the top, which is customized to them. Users with more privileges might see &#8220;edit&#8221; links next to content that they can edit. And returning commenters will see their name, e-mail, and URL helpfully filled in to comment forms. All these things change the output of the page, such that it wouldn&#8217;t be worth it for a page cache to hold on to that page — it would only be of use to the individual visitor who triggered it. So all of these page caching solutions have rules that make them &#8220;skip&#8221; the page cache if a user has a WordPress comment cookie, or a WordPress user account cookie (and also a post password cookie, though this is an infrequently used feature). If a site has an active commenting community or has open registration (or <em>required</em> registration), this means that a much smaller percentage of page views can be <strong>cache hits</strong>. Instead, they are the dreaded <strong>cache miss</strong>, and they fall back to having WordPress generate a dynamic page.</p>\n<p>The difference between a cache miss and a cache hit is not small. A cache hit takes minimal effort for the server, and can be delivered to the user much faster. It can be the difference between 1 second and 0.002 seconds. Five hundred times slower. Dynamic views keep the server connection open for longer, and take up CPU cycles. This can snowball under heavy load. Pages start taking longer, and because they start taking longer, less CPU is available. Eventually they can time out, or the server can run out of connections. Not good. You want cache hits, during a situation like this, but if the traffic isn&#8217;t anonymous (non-comment-cookie, non-logged-in-cookie), the available caching solutions just give up.</p>\n<p>I&#8217;ve been solving this issue for years with custom caching solutions that strip the customizations from the page, so that the cache can be configured to serve one static page to everyone. Now, I&#8217;ve moved these techniques into a plugin, and I&#8217;m calling it <a title=\"View the Cache Buddy WordPress plugin\" href=\"https://wordpress.org/plugins/cache-buddy/\">Cache Buddy</a>.</p>\n<p>Cache Buddy works by doing the following:</p>\n<ol>\n<li>Changes what paths logged-in cookies are set for (so they work in the WordPress backend, but don&#8217;t exist on the front of the site).</li>\n<li>Sets custom cookies with relevant information about the logged-in user, on the front of the site, making these cookies JavaScript-readable.</li>\n<li>Sets custom cookies for commenters (again, JavaScript-readable), and doesn&#8217;t set the normal WordPress comment cookies.</li>\n<li>Uses the information from these JavaScript cookies, plus some comment form magic, to recreate the comment form experience users would get from a dynamic page.</li>\n</ol>\n<p>This means that you can log in to WordPress, and then go a view a post&#8217;s comment form, and see &#8220;You are logged in as <strong>Mark</strong>. Log out?&#8221;. Or you can be a non-account-having commenter who has commented, and your information will be filled in. Or maybe the site requires registration, and you&#8217;re not signed in. You&#8217;ll see the normal prompt to sign in. But here&#8217;s the kicker: <b>all of these pages are the same page, and will be cached by page caching solutions.</b> The customizations are all done in JavaScript, using the custom (and unknown to WordPress-optimized page caches) cookies that Cache Buddy sets.</p>\n<p><strong>What about the toolbar?</strong></p>\n<p>Well, by default, Subscriber and Contributor users won&#8217;t see it. But it honestly isn&#8217;t very useful to them anyway. But Authors, Editors and Administrators (who should be a very small percentage of viewers) will still get dynamic page views like they do now, and they&#8217;ll see the toolbar.</p>\n<p><strong>What about BuddyPress?</strong></p>\n<p>Good luck. Some plugins customize the page so much that all views really do need to be dynamic. Object Caching is your friend, for these cases.</p>\n<p><strong>Is this for every site?</strong></p>\n<p>No. If you have a BuddyPress site or an e-commerce site, you may honestly need WordPress logged-in cookies available on the front of your site. But if you&#8217;re just running a blog/CMS site with a significant number of commenters and logged-in Subscribers, this plugin could massively speed up your site, because requests that had to always be dynamic before, can now be served from a page cache.</p>\n<p><strong>What about the &#8220;Meta&#8221; widget?</strong></p>\n<p>Not currently supported, but I&#8217;m hoping to add support for it.</p>\n<p><strong>What about other logged-in site customizations?</strong></p>\n<p>The user will appear to by an anonymous visitor. But you could recreate them in JS by reading the cookies that Cache Buddy sets.</p><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/markjaquith.wordpress.com/5172/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/markjaquith.wordpress.com/5172/\" /></a> <img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=markjaquith.wordpress.com&blog=316&post=5172&subd=markjaquith&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 27 Mar 2015 20:31:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Mark Jaquith\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"Jen Mylo: Defending Drupal\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"http://jenmylo.com/?p=4910\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"https://jenmylo.com/2015/03/23/defending-drupal/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7353:\"<p>The last 7 years of my life have been all WordPress, all the time. In that time we went from powering around 2 million sites to many tens of millions. Today, W3Techs says:</p>\n<blockquote><p>WordPress is used by 23.6% of all the websites, that is a content management system market share of 60.8%.</p></blockquote>\n<p>I wish that sentence had a semicolon instead of a comma, but wow. Drupal, by comparison:</p>\n<blockquote><p>Drupal is used by 2.0% of all websites, that is 5.1% of all the websites whose content management system we know.</p></blockquote>\n<p>Sometimes, people like to pit WordPress and Drupal against each other, as if we are fighting each other, rather than fighting proprietary software. At WordCamps, meetups, or any professional gathering where someone asks a question (or makes a snarky comment) about Drupal, I point out that we are far more similar than we are different. &#8220;Open source CMS built with PHP&#8221; describes us both, as does any description of the contributor model, or even the economic models &#8212; how many times have I heard Acquia is to Drupal as Automattic is to WordPress? (A lot.) We&#8217;ve even shared booth space at the OSCON expo.</p>\n<p>To drive the point home I often say that if you were stuck in an elevator/sitting next to someone on a plane, how psyched would you be to be sitting next to a Drupal person, who would totally get all your references and be able to have a conversation you&#8217;d enjoy? That usually gets a nod or two. Because, yeah, we&#8217;re a bunch of open source geeks who care way too much about things like software licenses and commit status and number of props. We are, in short, <em>both</em> ridiculous in the grand scheme of things &#8212; we&#8217;re not curing cancer or ending world hunger. At best we are powering the websites of those who are, and if we ceased to exist tomorrow, it wouldn&#8217;t be the end of the world (just of us). But free software is awesome, so yay! Let&#8217;s all be friends!</p>\n<p>At conferences, people sometimes have been confused if I&#8217;m hanging around with <a href=\"http://www.amye.org/\">Amye</a> or other Drupal women I know and like. They ask, &#8220;Aren&#8217;t you rivals?&#8221; And then we laugh at them. Cue the more-alike-than-different stuff.</p>\n<p>So I was kind of bummed today after all those years of defending Drupal and claiming kinship to see it pissing* all over WordPress today. But I should backtrack.</p>\n<p>For years, people in the WP community have wished there was a way to pay the more advanced contributors to work on core full-time. Sure, Automattic, 10Up, Human Made, and other companies have been contributing some people, but there are only so many donated employees a company can float. We all get that. For a while people talked about the WordPress Foundation as a way to pay people to work on stuff, but that didn&#8217;t wind up being possible. So when people started doing things like <a href=\"https://www.indiegogo.com/projects/buddypress-bbpress-glotpress-development\">Jtrip&#8217;s Indiegogo</a>, it was a natural evolution, though it seemed not very scalable.</p>\n<p>So when I saw <a href=\"https://rubytogether.org/\">Ruby Together</a> a few weeks ago, I thought it was amazing.</p>\n<p><a href=\"https://rubytogether.org/\"><img class=\"aligncenter wp-image-4914 size-full\" src=\"https://jenmylo.files.wordpress.com/2015/03/screen-shot-2015-03-23-at-10-19-27-am.png?w=520&h=485\" alt=\"screenshot of rubytogether.org\" width=\"520\" height=\"485\" /></a></p>\n<p>Then came the Drupal 8 fundraiser, and I thought that was pretty cool too. Matching donations and whatnot!</p>\n<p>And then I saw this:</p>\n<p><a href=\"https://jenmylo.files.wordpress.com/2015/03/screen-shot-2015-03-23-at-9-49-35-am.png\"><img class=\"aligncenter size-full wp-image-4912\" src=\"https://jenmylo.files.wordpress.com/2015/03/screen-shot-2015-03-23-at-9-49-35-am.png?w=520&h=499\" alt=\"Screen Shot 2015-03-23 at 9.49.35 AM\" width=\"520\" height=\"499\" /></a></p>\n<p>I smiled, recognizing several people I quite like. But that one in the lower left, what?? I clicked through and saw this:</p>\n<p><img class=\"aligncenter size-full wp-image-4911\" src=\"https://jenmylo.files.wordpress.com/2015/03/screen-shot-2015-03-23-at-9-56-37-am.png?w=520&h=333\" alt=\"fundraising website for drupal 8 featuring a graphic of the Drupal logo peeing on the Joomla and WordPress logos\" width=\"520\" height=\"333\" /></p>\n<p>I was like, &#8220;What?&#8221;</p>\n<p>Then I was like, &#8220;No, really, what?!&#8221;</p>\n<p>I get it, this person thought this shirt from a previous Drupal event was funny and would fire people up to donate. But really?</p>\n<p>That shirt is so completely tasteless I am horrified that the Drupal community endorses it.</p>\n<p>And now we&#8217;re back to <em>Drupal is pissing on WordPress</em>.</p>\n<p>I&#8217;ve given so many talks at WordCamps with a component about how it&#8217;s important to be nice, respectful, and welcoming &#8212; including the use of appropriate language and imagery &#8212; to the point that some people would really like to tell me to shut the fuck** up (or have!). I have extended that &#8220;let&#8217;s be nice&#8221; spiel to talking about Drupal multiple times. I would never design a tshirt that showed the W pissing on the Drupal (and I&#8217;ve designed <a title=\"WCSF Shirt\" href=\"https://jenmylo.com/2011/08/03/wcsf-shirt/\">a controversial WordCamp shirt</a> or two in my time) because it&#8217;s not funny, it&#8217;s just tasteless and disrespectful. So that Drupal shirt makes me sad. I know that probably none of the people I know and like had a hand in making it. But it bums me out that as a community they seem to think it is okay, good even, if they&#8217;re willing to put it on the front page of the fundraiser.</p>\n<p>&#8220;You can feel good about our project without putting down other projects, so let&#8217;s keep it clean.&#8221; I said something similar (s/our project/yourself) to my nieces and their friends when they were in 9th grade and had a habit of putting down other girls to feel better about themselves (as so many adolescents do). I hope more people will remember this in the future, and just because you can think of a snarky/sarcastic/mean/tasteless joke that elevates your side and pushes down the other <em>doesn&#8217;t mean you should</em>.</p>\n<p>In any case, one person&#8217;s misstep shouldn&#8217;t be cause to demonize a whole project community. Assume good intentions. Reach out when something is awry instead of devolving into one-upmanship. Competition is healthy but there&#8217;s no reason to be jerks to each other. And also? Thinking there are sides is <strong>really</strong> silly. We&#8217;re <em>all</em> ridiculous open source CMS geeks. We&#8217;re all one side. Let&#8217;s stand together, y&#8217;all.</p>\n<hr />\n<p><small><strong>* </strong>I&#8217;ve always hated the Calvin peeing stickers, and <a href=\"https://triviahappy.com/articles/the-tasteless-history-of-the-peeing-calvin-decal\">so has Bill Watterson</a>.</small></p>\n<p><small>** Profanity used intentionally to illustrate that it&#8217;s not appropriate language in a welcoming community.</small></p><img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=jenmylo.com&blog=45389656&post=4910&subd=jenmylo&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 23 Mar 2015 17:30:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Jen Mylo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"Jen Mylo: Distraction-free Writing Mode\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"http://jenmylo.com/?p=4787\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://jenmylo.com/2015/01/17/distraction-free-writing-mode/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6730:\"<p>Once upon a time in WordPress there was a New Feature called Distraction-free writing mode. You accessed it by clicking the icon in the editor toolbar that means <em>full screen</em> pretty much everywhere on the web.</p>\n<p><img class=\"aligncenter size-full wp-image-4788\" src=\"https://jenmylo.files.wordpress.com/2015/01/dfw-icon-highlight.png?w=520&h=71\" alt=\"post editor toolbar\" width=\"520\" height=\"71\" /></p>\n<p>It would load a new screen tha mostly just consisted of a writing box not surrounded by meta boxes or formatting, and what limited formatting options there were would only appear when you moused out of the writing area. It wasn&#8217;t perfect (I would have liked that fading toolbar to have all the same formatting options as the regular editor) but it <em>was</em> pretty non-distracting, and it just felt calm.</p>\n<p><img class=\"aligncenter size-full wp-image-4790\" src=\"https://jenmylo.files.wordpress.com/2015/01/dfw-ui.png?w=520\" alt=\"old distraction-free writing interface\" /></p>\n<p>A while back I noticed some changes in the wp-admin regular editor. All the navigation and meta boxes now faded away while you were writing, and I thought, &#8220;Oh, that&#8217;s pretty nice, kind of a DFW Lite!&#8221; I didn&#8217;t pay too much attention, as I was just writing a quick post, but in my head I approved, and thought it was a good improvement. Until this morning.</p>\n<p>Most of my blog-based activity happens on work-related blogs that have front-end posting forms, so it&#8217;s been a while since I tried to access DFW mode. But I was going to be writing a long post, and I wanted to go over into that peaceful screen, so I clicked on the full-screen icon. That&#8217;s when I discovered that what I thought was DFW Lite was actually the new DFW. There was no more new screen.</p>\n<p>At first I thought,&#8221;Hm, that&#8217;s a lot more efficient. Good for them!&#8221; Then I started writing, and thought, &#8220;[Letters-in-a-configuration-to-replicate-my-slightly-alarmed-and-uncomfortable-sound]!&#8221; I hated to admit it, but I felt physically uncomfortable. Am I turning into Sheldon (<a title=\"Video from Big Bang Theory\" href=\"https://www.youtube.com/watch?v=ynUfxitGpfU\">skip to 3:34</a>)? Crap! Anyway, here&#8217;s why I don&#8217;t love the new DFW.</p>\n<p>When wp core switched over to the &#8220;toolbar anchors to top of editor no matter how long your post&#8221; setup, users lost the ability to grab a corner of the editor and drag it to make it taller. Since it is supposed to automatically resize as you write, most people thought this was a tradeoff with a net benefit, and even though I really didn&#8217;t want to lose my little corner resize handle, I agreed that the net benefit was worth it. The thing is, if in your head you&#8217;ve already thought out a long post, starting in the small box feels cramped, kind of like when you have to repack a sleeping bag and you&#8217;re smooshing it with all your might to get it to fit back into the compact stuff sack.</p>\n<p>Think about opening a New Document in MS Word (or equivalent writing program) , or a writer putting a fresh piece of paper in the typewriter (for those who are too young to remember, <a title=\"Video of someone putting paper into a typewriter\" href=\"https://www.youtube.com/watch?v=FkUXn5bOwzk\">it&#8217;s like this</a>). There have been reams written by famous authors in the past about the feeling that action engenders &#8212; a feeling of limitless possibilities, a knock on the creative door, an open road ahead. That&#8217;s what DFW tried to emulate. Starting in the small box instead of the full height box feels like possibilities with limits, a creative window that won&#8217;t open more than 3 inches for safety, a road with one lane closed for construction. Thoughts scrunch down to try to fit into the available space.</p>\n<p>Even when the box expands to be the height of the screen (minus padding against top and bottom of browser), a chunk of space is lost at the top for the toolbar. That fade it used to have really did remove distraction. I wish there had been a way to combine the zen of the fade away (Matt&#8217;s original nickname for DFW was zen mode) with the convenience of the always-at-top placement.</p>\n<p>In the old DFW, the writing window really did have that feeling of a fresh New Document or crisp new sheet of paper. Now, even once it&#8217;s tall, it&#8217;s a bit off-center to the left, because that&#8217;s where the editor box is when on a screen containing navigation and metaboxes.</p>\n<p><img class=\"aligncenter size-full wp-image-4798\" src=\"https://jenmylo.files.wordpress.com/2015/01/screen-shot-2015-01-17-at-7-54-33-am.png?w=520&h=313\" alt=\"Screenshot of current distraction-free mode\" width=\"520\" height=\"313\" /></p>\n<p>There was a time (pre-2000) when I didn&#8217;t think too much about alignment in UIs. Then I got a lot of design ideas drilled into my head that stuck, especially regarding alignment. I like asymmetry in a lot of things, always have. Hell, in a site we were just working on one of the things we said we wanted was some asymmetry. But for DFW, the symmetry &#8212; the centeredness &#8212; was a big part of what made that screen so calming. Your brain didn&#8217;t have to do any pattern recognition or internal balancing to make it feel right. But now it skews to the left and it&#8217;s driving me crazy, Sheldon style. This isn&#8217;t zen for me; it&#8217;s a misused apostrophe, a lowercase p, a cabinet door left open.</p>\n<p>I thought I&#8217;d be a holdout forever against using the new <a title=\"wordpress.com\" href=\"http://wordpress.com\">wordpress.com</a> posting interface (I have a lot of issues with it, surprise), but, well, their DFW has that open and symmetrical feeling (even if it has other problems) that makes for a non-Sheldony writing experience.</p>\n<p><img class=\"aligncenter size-full wp-image-4789\" src=\"https://jenmylo.files.wordpress.com/2015/01/screen-shot-2015-01-17-at-7-27-45-am.png?w=520&h=378\" alt=\"Screenshot of distraction-free writing mode on wordpress.com\" width=\"520\" height=\"378\" /></p>\n<p>So this might be my last post written in wp-admin DFW mode for now. Farewell, old friend!</p>\n<p><em>* * *</em></p>\n<p><em>Standard disclaimer when writing about WordPress: This is my personal opinion. I have not been the UX lead for WordPress core for a couple of years now, so this post on my personal blog should not be seen as representing the WordPress project in any way, it&#8217;s just my personal experience with a user interface.</em></p><img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=jenmylo.com&blog=45389656&post=4787&subd=jenmylo&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 17 Jan 2015 16:08:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Jen Mylo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:8:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Sat, 08 Oct 2016 21:51:28 GMT\";s:12:\"content-type\";s:8:\"text/xml\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:13:\"last-modified\";s:29:\"Sat, 08 Oct 2016 21:30:09 GMT\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:4:\"x-nc\";s:11:\"HIT lax 250\";s:16:\"content-encoding\";s:4:\"gzip\";}}s:5:\"build\";s:14:\"20160912164945\";}','no'),(9448,'_site_transient_timeout_browser_85764592803669371898197cc9c1e106','1476563988','no'),(9449,'_site_transient_browser_85764592803669371898197cc9c1e106','a:9:{s:8:\"platform\";s:7:\"Windows\";s:4:\"name\";s:6:\"Chrome\";s:7:\"version\";s:12:\"45.0.2454.85\";s:10:\"update_url\";s:28:\"http://www.google.com/chrome\";s:7:\"img_src\";s:49:\"http://s.wordpress.org/images/browsers/chrome.png\";s:11:\"img_src_ssl\";s:48:\"https://wordpress.org/images/browsers/chrome.png\";s:15:\"current_version\";s:2:\"18\";s:7:\"upgra