INSERT INTO `wp_posts` VALUES (2,1,'2016-04-04 16:00:43','2016-04-04 16:00:43','<strong>HUNGPHATADS</strong>\r\n\r\nVới kinh nghiệm trong nghề quảng cáo, đội ngũ thợ chuyên nghiệp thành thạo nghề, với biển quảng cáo trên mọi chất liệu:\r\n\r\nLàm biển ốp alu cửa hàng, showroom, ốp alu mặt nội thất\r\n\r\nBiển hộp đèn :bạt, alu, mica, lắp đèn chiếu sang\r\n\r\nBiển đèn LED, LED chữ chạy.\r\n\r\nBiển quảng cáo chữ nổi: biển alu chữ nổi, mica chữ nổi, formex chữ nổi\r\n\r\nBiển backdrop lễ tân, biển công ty lễ tân\r\n\r\nBiển vẫy, biển chào hàng, biển hộp đèn hút nổi\r\n\r\nBiển bạt hiflex, background sân khấu, pano khổ lớn\r\n\r\nBiển tên phòng, biển tên công ty, biển chức danh: mica,alu, đồng, inox ,tôn\r\n\r\nGia công quầy kệ: meu chữ T,meu chữ L, menu đế rút, hộp mica, kệ mica, hòm phiếu, thùng phiếu\r\n\r\nIn ấn giá rẻ:  in bạt hiflex, in decal, in card visit, in tờ rơi, tờ gấp, in ấn trên mọi chất liệu\r\n\r\n-----------------------------------------------------------------------------------\r\n\r\nCÔNG TY TNHH TM &amp; QUẢNG CÁO HÙNG PHÁT\r\n\r\nĐịa chỉ: Số 9, ngõ 39,Đình Thôn, Mỹ Đình, Hà Nội\r\n\r\nHotline: 01649803432 .\r\n\r\nEmail: <a href=\"mailto:Trananh.hn133@gmail.com\">Trananh.hn133@gmail.com</a>\r\n\r\nSkype: trananh.hn133\r\n\r\nFanpge: https://www.facebook.com/bienquangcaohungphatads/?fref=ts','Giới thiệu','','publish','closed','closed','','gioi-thieu','','','2016-04-25 09:33:12','2016-04-25 09:33:12','',0,'http://hungphatads.com/?page_id=2',0,'page','',0),(98,3,'2016-04-25 09:33:12','2016-04-25 09:33:12','<strong>HUNGPHATADS</strong>\r\n\r\nVới kinh nghiệm trong nghề quảng cáo, đội ngũ thợ chuyên nghiệp thành thạo nghề, với biển quảng cáo trên mọi chất liệu:\r\n\r\nLàm biển ốp alu cửa hàng, showroom, ốp alu mặt nội thất\r\n\r\nBiển hộp đèn :bạt, alu, mica, lắp đèn chiếu sang\r\n\r\nBiển đèn LED, LED chữ chạy.\r\n\r\nBiển quảng cáo chữ nổi: biển alu chữ nổi, mica chữ nổi, formex chữ nổi\r\n\r\nBiển backdrop lễ tân, biển công ty lễ tân\r\n\r\nBiển vẫy, biển chào hàng, biển hộp đèn hút nổi\r\n\r\nBiển bạt hiflex, background sân khấu, pano khổ lớn\r\n\r\nBiển tên phòng, biển tên công ty, biển chức danh: mica,alu, đồng, inox ,tôn\r\n\r\nGia công quầy kệ: meu chữ T,meu chữ L, menu đế rút, hộp mica, kệ mica, hòm phiếu, thùng phiếu\r\n\r\nIn ấn giá rẻ:  in bạt hiflex, in decal, in card visit, in tờ rơi, tờ gấp, in ấn trên mọi chất liệu\r\n\r\n-----------------------------------------------------------------------------------\r\n\r\nCÔNG TY TNHH TM &amp; QUẢNG CÁO HÙNG PHÁT\r\n\r\nĐịa chỉ: Số 9, ngõ 39,Đình Thôn, Mỹ Đình, Hà Nội\r\n\r\nHotline: 01649803432 .\r\n\r\nEmail: <a href=\"mailto:Trananh.hn133@gmail.com\">Trananh.hn133@gmail.com</a>\r\n\r\nSkype: trananh.hn133\r\n\r\nFanpge: https://www.facebook.com/bienquangcaohungphatads/?fref=ts','Giới thiệu','','inherit','closed','closed','','2-revision-v1','','','2016-04-25 09:33:12','2016-04-25 09:33:12','',2,'http://hungphatads.com/2-revision-v1/',0,'revision','',0),(85,3,'2016-04-25 09:39:21','2016-04-25 09:39:21','<strong>Biển hộp đèn mica - alu âm bản </strong>\r\n\r\n<span class=\"st\"><em>Biển hộp đèn</em> Alumium cắt CNC <em>âm bản</em> là sử dụng công nghệ cắt CNC để cắt khắc các họa tiết, thông tin sau đó sử dụng mica xuyên sáng để dán vào mặt <em>biển</em> …</span>\r\n\r\nHộp đèn aluminium là hình thức biển bảng trụ sở, được các doanh nghiệp sử dụng phổ biến hiện nay.\r\n\r\n<a href=\"http://quangcaovietnhat.net/wp-content/uploads/2015/07/bien-am-ban1.jpg\"><img class=\"wp-image-2058 aligncenter\" src=\"http://quangcaovietnhat.net/wp-content/uploads/2015/07/bien-am-ban1.jpg\" alt=\"bien am ban1\" width=\"800\" height=\"310\" /></a>\r\n\r\n<strong>Biển hộp đèn mặt Alu, nội dung khoét âm bản gắn mica trong biển có đèn Led</strong>\r\n\r\nMặt biển làm bằng chất liệu alumium trong nhà hoặc ngoài trời cắt cnc bỏ hết phần chữ để lại phần mặt biển , sau đó lấy tấm mika tùy chọn màu lót ở phần mặt dưới tấm alumium sau đó đưa vào phần khung đã được thi công và hàn trước đó , trong phần khung đã được lắp đèn led hoặc ,neon để chiếu sáng về ban đêm.\r\n\r\n<a href=\"http://quangcaovietnhat.net/wp-content/uploads/2015/07/bien-am-ban2.jpg\"><img class=\"wp-image-2059 aligncenter\" src=\"http://quangcaovietnhat.net/wp-content/uploads/2015/07/bien-am-ban2.jpg\" alt=\"bien am ban2\" width=\"800\" height=\"600\" /></a>\r\n\r\n<a href=\"http://quangcaovietnhat.net/wp-content/uploads/2015/07/bien-am-ban3.jpg\"><img class=\"wp-image-2060 aligncenter\" src=\"http://quangcaovietnhat.net/wp-content/uploads/2015/07/bien-am-ban3.jpg\" alt=\"bien am ban3\" width=\"800\" height=\"600\" /></a>\r\n\r\n<a href=\"http://quangcaovietnhat.net/wp-content/uploads/2015/07/bien-am-ban4.jpg\"><img class=\"wp-image-2061 aligncenter\" src=\"http://quangcaovietnhat.net/wp-content/uploads/2015/07/bien-am-ban4.jpg\" alt=\"bien am ban4\" width=\"800\" height=\"601\" /></a>\r\n\r\n<img class=\"wp-image-2062 aligncenter\" src=\"http://quangcaovietnhat.net/wp-content/uploads/2015/07/bien-am-ban5.jpg\" alt=\"bien am ban5\" width=\"800\" height=\"509\" />\r\n\r\n<strong>Quy cách hộp đèn :</strong>\r\n* Khung sắt vuông 16mm đến 30mm( tùy vào kích thướt hộp đèn)\r\n* Alu ngoại nhập ( Vertu, alcorest…)\r\n* Dán keo hoặc bắn ốc vít.\r\n* Đèn neon Điện Quang (hoặc Philips) và neonsign, ánh sáng đẹp nhất là gắn Led.\r\n\r\n<strong>Ưu điểm</strong> : loại biển này rất đẹp ,thẩm mỹ và sang trọng .có nhiều mầu sắc để khách hàng có thể lựa chọn.có thể ứng dụng nhiều trong các siêu thị nhà hàng ,trung tâm thương mại nơi mà lương khách hàng cao thường đến.\r\n\r\n<strong><em>Giá Cả phụ thuộc vào số lượng thực tế, khu vực thi công, bản vẽ thiết kế, độ khó của công trình. Quý Khách liên hệ trực tiếp để có bảng báo giá cụ thể.</em></strong>\r\n\r\n<strong>CÔNG TY TNHH TM &amp; QUẢNG CÁO HÙNG PHÁT</strong>\r\n\r\n<em>Địa chỉ: Số 9, ngõ 39,Đình Thôn, Mỹ Đình, Hà Nội </em>\r\n\r\nHotline: 01649803432  - 0982030255\r\n\r\nEmail: hungphatads@gmail.com\r\n\r\nSkype: trananh.hn133\r\n\r\nFanpge: https://www.facebook.com/bienquangcaohungphatads/?fref=ts','Biển hộp đèn mica - alu âm bản','','publish','closed','open','','bien-hop-den-chat-luong-cao','','','2016-04-25 09:39:21','2016-04-25 09:39:21','',0,'http://hungphatads.com/?p=85',0,'post','',0),(4,1,'2016-04-04 16:06:21','2016-04-04 16:06:21',' ','','','publish','closed','closed','','4','','','2016-06-08 02:55:00','2016-06-08 02:55:00','',0,'http://hungphatads.com/2016/04/04/4/',2,'nav_menu_item','',0),(204,1,'2016-06-08 02:01:59','2016-06-08 02:01:59','','Trang chủ','','publish','closed','closed','','trang-chu','','','2016-06-08 02:55:00','2016-06-08 02:55:00','',0,'http://hungphatads.com/?p=204',1,'nav_menu_item','',0),(6,1,'2016-04-04 16:06:58','2016-04-04 16:06:58','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://hungphatads.com/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Giới thiệu','','inherit','closed','closed','','2-revision-v1','','','2016-04-04 16:06:58','2016-04-04 16:06:58','',2,'http://hungphatads.com/2016/04/04/2-revision-v1/',0,'revision','',0),(7,1,'2016-04-04 16:07:23','2016-04-04 16:07:23','<strong>CÔNG TY TNHH TM &amp; QUẢNG CÁO HÙ