đổi và tư vấn về quy cách và hình thức thi công như: chất liệu, vật liệu ...\r\n\r\n- Nếu quý khách hàng đã có kích thước, số đo hoặc bản vẽ phác thảo rồi xin vui lòng gửi email cho chúng tôi <b>hungphatads@gmail.com </b>để chúng tôi tiến hành báo giá</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td><strong>2. KHẢO SÁT THỰC TẾ</strong>\r\n\r\n- Sau khi trao đổi và sắp xếp lịch hẹn, chúng tôi sẽ có nhân viên đến địa điểm thi công khảo sát đo đạc thực tế và trao đổi cụ thể hơn với quý khách hàng</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td><strong>3. THIẾT KẾ MAQUETE</strong>\r\n\r\n- Sau khi nắm rõ ý tưởng, quy cách và hình thức thi công. Chúng tôi sẽ thiết kế maket theo yêu cầu của quý khách và trao đổi qua email quý khách cung cấp, nếu có chỉnh sửa sẽ trao đổi qua email cho quý khách</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td><strong>4. BÁO GIÁ &amp; KÝ HỢP ĐỒNG</strong>\r\n\r\n- Sau khi quý khách đã đồng ý bản vẽ thiết kế, chúng tôi sẽ tiến hành làm báo giá và gửi cho quý khách qua email.\r\n\r\n- Sau khi quý khách đồng ý theo báo giá quý khách vui lòng ký xác nhận vào báo giá hoặc gửi qua email xác nhận đặt hàng.\r\n\r\n- Trong trường hợp nếu đơn hàng nhỏ hơn 20 triệu đồng, báo giá có thể vừa là hợp đồng thi công và không cần làm hợp đồng, chỉ cần hai bên ký xác nhận trên báo giá và mỗi bên giữ 01 (một) hoặc 02 (hai) bản.\r\n\r\n- Nếu giá trị hợp đồng tương đối lớn sẽ tiến hành ký kết hợp đồng.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td><strong>5. THANH TOÁN VÀ NGHIỆM THU</strong>\r\n\r\n- Nếu hợp đồng nhỏ hơn 100 triệu đồng, quý khách sẽ chia làm 02 lần thanh toán:\r\n\r\n+ Đợt 01: sau khi ký hợp đồng và tiến hành thi công (hoặc đưa vật tư đến địa điểm thi công). Quý khách sẽ thanh toán 50% giá trị hợp đồng.\r\n\r\n+ Đợt 02: sau khi thi công hoàn thiện và bàn giao, nghiệm thu. Quý khách thanh toán giá trị hợp đồng còn lại.\r\n\r\n- Nếu hợp đồng lớn hơn 100 triệu đồng, quý khách sẽ chia làm 03 lần thanh toán\r\n\r\n+ Đợt 01: sau khi ký hợp đồng và tiến hành thi công. Quý khách thanh toán 30% giá trị hợp đồng.\r\n\r\n+ Đợt 02: sau khi thi công khoảng 60% khối lượng công trình. Quý khách thanh toán 30% tiếp theo của hợp đồng.\r\n\r\n+ Đợt 03: sau khi hoàn thiện và bàn giao, nghiệm thu. Quý khách thanh toán phần còn lại của hợp đồng.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<strong>HÙNG PHÁT</strong> hy vọng sẽ tạo sự thuận lợi cho quý khách hàng trong việc giao dịch. Chúc quý khách một ngày làm việc vui vẻ.\r\n\r\nChào thân ái\r\n\r\n======================\r\n\r\n<strong>CÔNG TY TNHH TM &amp; QUẢNG CÁO HÙNG PHÁT</strong>\r\n\r\n<em>Địa chỉ: Số 9, ngõ 39,Đình Thôn, Mỹ Đình, Hà Nội </em>\r\n\r\nHotline: 01649803432  - 0982030255\r\n\r\nEmail: hungphatads@gmail.com\r\n\r\nSkype: trananh.hn133\r\n\r\nFanpge: https://www.facebook.com/bienquangcaohungphatads/?fref=ts\r\n\r\n</div></td>\r\n</tr>\r\n</tbody>\r\n</table>','Quy trình đặt hàng','','publish','closed','closed','','dat-hang','','','2016-06-08 03:57:23','2016-06-08 03:57:23','',0,'http://localhost/hungphatads/?page_id=23',0,'page','',0),(24,1,'2016-04-09 08:52:33','2016-04-09 08:52:33','Liên hệ 01689924896','Đặt hàng','','inherit','closed','closed','','23-revision-v1','','','2016-04-09 08:52:33','2016-04-09 08:52:33','',23,'http://localhost/hungphatads/23-revision-v1/',0,'revision','',0),(25,1,'2016-04-09 08:53:08','2016-04-09 08:53:08','','Quy Trình Đặt Hàng','','publish','closed','closed','','25','','','2016-06-08 02:55:00','2016-06-08 02:55:00','',0,'http://localhost/hungphatads/?p=25',4,'nav_menu_item','',0),(26,1,'2016-04-09 08:54:53','2016-04-09 08:54:53',' ','','','publish','closed','closed','','26','','','2016-06-08 02:55:00','2016-06-08 02:55:00','',0,'http://localhost/hungphatads/?p=26',3,'nav_menu_item','',0),(27,1,'2016-04-09 08:57:15','2016-04-09 08:57:15','<h3>» BIỂN ĐIỆN TỬ LED 1 MÀU</h3>\r\nLà bảng được kết hợp từ nhiều module Led ma trận theo chiều rộng và chiều cao. Màu hiển thị của loại bảng này thường là màu đỏ. Bảng điện tử của chúng tôi dễ dàng thay đổi thông tin hiển thị thông qua phần mềm được cài đặt trong máy tính của quý khách hàng. Bảng điện tử Led một màu thường có 2 loại cụ thể như sau:\r\n\r\nLà bảng được kết hợp từ nhiều module Led ma trận theo chiều rộng và chiều cao. Màu hiển thị của loại bảng này thường là màu đỏ. Bảng điện tử của chúng tôi dễ dàng thay đổi thông tin hiển thị thông qua phần mềm được cài đặt trong máy tính của quý khách hàng. Bảng điện tử Led một màu thường có 2 loại cụ thể như sau:\r\n<h2><strong>1) BẢNG ĐIỆN TỬ LED MA TRẬN ĐƠN SẮC TRONG NHÀ\r\n(Indoor Single - Color Led board):</strong></h2>\r\nLoại bảng này được lắp trong nhà, hiển thị 1 màu thường là màu Đỏ, có độ sáng dưới<strong>1000mcd </strong>thích hợp với quan sát từ khoảng cách gần và cường độ sáng môi trường không cao mang tính công cộng phục vụ số đông người nhìn ở môi trường trong nhà. Loại màn hình này có nhiều độ phân giải khác nhau để khách hàng tùy chọn theo yêu cầu sử dụng. Thường là các loại pitch <strong>P4, P4.75, P7.62 </strong>. Pitch càng lớn thì độ phân giải càng thấp và ngược lại.\r\n\r\n<strong>Ứng dụng:</strong>\r\n- Dùng làm các bảng Text thông tin trong các tòa nhà văn phòng, cửa hàng, siêu thị để hiển thị những thông tin cần thiết.\r\n- Ứng dụng trong lĩnh vực giáo dục làm Bảng lịch công tác, Lịch họp, Bảng thông báo thông tin...\r\n- Ứng dụng làm các phương tiện hiển thị chỉ dẫn trên các trục đường giao thông, đường cao tốc, cổng gianh giới giữa các tỉnh ...\r\n\r\n<img class=\"size-medium wp-image-28 aligncenter\" src=\"http://localhost/hungphatads/wp-content/uploads/2016/04/led-2-300x196.jpg\" alt=\"led 2\" width=\"300\" height=\"196\" />','BẢNG ĐIỆN TỬ LED 1 MÀU','','publish','open','open','','bang-dien-tu-led-1-mau','','','2016-04-18 09:15:02','2016-04-18 09:15:02','',0,'http://localhost/hungphatads/?p=27',0,'post','',0),(29,1,'2016-04-09 08:57:15','2016-04-09 08:57:15','<h3>» BIỂN ĐIỆN TỬ LED 1 MÀU</h3>\r\nLà bảng được kết hợp từ nhiều module Led ma trận theo chiều rộng và chiều cao. Màu hiển thị của loại bảng này thường là màu đỏ. Bảng điện tử của chúng tôi dễ dàng thay đổi thông tin hiển thị thông qua phần mềm được cài đặt trong máy tính của quý khách hàng. Bảng điện tử Led một màu thường có 2 loại cụ thể như sau:\r\n\r\nLà bảng được kết hợp từ nhiều module Led ma trận theo chiều rộng và chiều cao. Màu hiển thị của loại bảng này thường là màu đỏ. Bảng điện tử của chúng tôi dễ dàng thay đổi thông tin hiển thị thông qua phần mềm được cài đặt trong máy tính của quý khách hàng. Bảng điện tử Led một màu thường có 2 loại cụ thể như sau:\r\n<h2><strong>1) BẢNG ĐIỆN TỬ LED MA TRẬN ĐƠN SẮC TRONG NHÀ\r\n(Indoor Single - Color Led board):</strong></h2>\r\nLoại bảng này được lắp trong nhà, hiển thị 1 màu thường là màu Đỏ, có độ sáng dưới<strong>1000mcd </strong>thích hợp với quan sát từ khoảng cách gần và cường độ sáng môi trường không cao mang tính công cộng phục vụ số đông người nhìn ở môi trường trong nhà. Loại màn hình này có nhiều độ phân giải khác nhau để khách hàng tùy chọn theo yêu cầu sử dụng. Thường là các loại pitch <strong>P4, P4.75, P7.62 </strong>. Pitch càng lớn thì độ phân giải càng thấp và ngược lại.\r\n\r\n<strong>Ứng dụng:</strong>\r\n- Dùng làm các bảng Text thông tin trong các tòa nhà văn phòng, cửa hàng, siêu thị để hiển thị những thông tin cần thiết.\r\n- Ứng dụng trong lĩnh vực giáo dục làm Bảng lịch công tác, Lịch họp, Bảng thông báo thông tin...\r\n- Ứng dụng làm các phương tiện hiển thị chỉ dẫn trên các trục đường giao thông, đường cao tốc, cổng gianh giới giữa các tỉnh ...\r\n\r\n<img class=\"size-medium wp-image-28 aligncenter\" src=\"http://localhost/hungphatads/wp-content/uploads/2016/04/led-2-300x196.jpg\" alt=\"led 2\" width=\"300\" height=\"196\" />','BẢNG ĐIỆN TỬ LED 1 MÀU','','inherit','closed','closed','','27-revision-v1','','','2016-04-09 08:57:15','2016-04-09 08:57:15','',27,'http://localhost/hungphatads/27-revision-v1/',0,'revision','',0),(30,1,'2016-04-09 10:08:45','2016-04-09 10:08:45','Biển LED, “Không còn mới”\r\n\r\nĐang với sự phát triển của Xã hội thì <em><strong>Biển quảng cáo led</strong></em>không còn gì là xa lạ với mọi người.\r\n\r\nQuý khách hàng băn khoăn:\r\n\r\nCơ chế hoạt động, tuổi thọ sử dụng, nên dùng loại nào cho tốt… Chọn đơn vị thi công nào các dịch vụ bảo hành, bảo trì nhanh gọn.\r\n\r\nTất cả những băn khoăn của Quý khách hàng sẽ được <strong>tư vấn miễn phí.</strong>','Biển led vẫy','','publish','open','open','','bien-led-vay','','','2016-04-18 09:14:46','2016-04-18 09:14:46','',0,'http://localhost/hungphatads/?p=30',0,'post','',0),(31,1,'2016-04-09 10:08:38','2016-04-09 10:08:38','','led 1','','inherit','open','closed','','led-1','','','2016-04-09 10:08:38','2016-04-09 10:08:38','',30,'http://localhost/hungphatads/wp-content/uploads/2016/04/led-1.gif',0,'attachment','image/gif',0),(32,1,'2016-04-09 10:08:45','2016-04-09 10:08:45','','Biển led vẫy','','inherit','closed','closed','','30-revision-v1','','','2016-04-09 10:08:45','2016-04-09 10:08:45','',30,'http://localhost/hungphatads/30-revision-v1/',0,'revision','',0),(33,1,'2016-04-09 10:08:56','2016-04-09 10:08:56','Biển LED, “Không còn mới”\r\n\r\nĐang với sự phát triển của Xã hội thì <em><strong>Biển quảng cáo led</strong></em>không còn gì là xa lạ với mọi người.\r\n\r\nQuý khách hàng băn khoăn:\r\n\r\nCơ chế hoạt động, tuổi thọ sử dụng, nên dùng loại nào cho tốt… Chọn đơn vị thi công nào các dịch vụ bảo hành, bảo trì nhanh gọn.\r\n\r\nTất cả những băn khoăn của Quý khách hàng sẽ được <strong>tư vấn miễn phí.</strong>','Biển led vẫy','','inherit','closed','closed','','30-revision-v1','','','2016-04-09 10:08:56','2016-04-09 10:08:56','',30,'http://localhost/hungphatads/30-revision-v1/',0,'revision',''