/h3>\r\nBiển tỷ giá ngoại tệ được làm bằng bóng đèn điện tử.\r\nĐiều khiển bằng phần mềm cài trên máy tính hoặc bộ điều khiển từ xa.\r\n\r\n- Phần hiển thị số:\r\n+ Sử dụng đèn LED 7 đoạn indoor, 3 màu đỏ, xanh lá, vàng.\r\n+ Cường độ sáng: min-max: 800-1200 (mcd).\r\n+ Góc nhìn rõ: 160 độ\r\n+ Tầm nhìn tối đa: 30m.','Biển Led tỷ giá','','inherit','closed','closed','','36-revision-v1','','','2016-04-09 10:11:16','2016-04-09 10:11:16','',36,'http://localhost/hungphatads/36-revision-v1/',0,'revision','',0),(39,1,'2016-04-09 10:12:03','2016-04-09 10:12:03','<h3>» CHỮ NỔI GẮN LED</h3>\r\nChữ nổi gắn LED đã đáp ứng được yêu cầu của khách hàng là ban ngày không cần bật điện thì chữ nổi vẫn hiển thị tốt, ban đêm khi bật đèn lên sẽ tạo ra ánh sáng trên mặt chữ, với các hiệu ứng nhấp nháy đa dạng sẽ tạo sự thu hút rất lớn của khách hàng.\r\n\r\nChữ uốn nổi bằng chất liệu Mica, Aluminium, Đồng, Inox, Foocmex được gắn hệ thống đèn led trên bề mặt chữ, hoặc có thể gắn trong chữ hắt sáng chân chữ và hắt sáng mặt chữ.','Chữ nổi công nghệ đèn Led','','publish','open','open','','chu-noi-cong-nghe-den-led','','','2016-04-09 10:12:03','2016-04-09 10:12:03','',0,'http://localhost/hungphatads/?p=39',0,'post','',0),(40,1,'2016-04-09 10:11:59','2016-04-09 10:11:59','','1 (1)','','inherit','open','closed','','1-1','','','2016-04-09 10:11:59','2016-04-09 10:11:59','',39,'http://localhost/hungphatads/wp-content/uploads/2016/04/1-1.jpg',0,'attachment','image/jpeg',0),(41,1,'2016-04-09 10:12:03','2016-04-09 10:12:03','<h3>» CHỮ NỔI GẮN LED</h3>\r\nChữ nổi gắn LED đã đáp ứng được yêu cầu của khách hàng là ban ngày không cần bật điện thì chữ nổi vẫn hiển thị tốt, ban đêm khi bật đèn lên sẽ tạo ra ánh sáng trên mặt chữ, với các hiệu ứng nhấp nháy đa dạng sẽ tạo sự thu hút rất lớn của khách hàng.\r\n\r\nChữ uốn nổi bằng chất liệu Mica, Aluminium, Đồng, Inox, Foocmex được gắn hệ thống đèn led trên bề mặt chữ, hoặc có thể gắn trong chữ hắt sáng chân chữ và hắt sáng mặt chữ.','Chữ nổi công nghệ đèn 