>\r\n<h1 id=\"chitiet\">Làm biển pano tấm lớn ngoài trời</h1>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td id=\"noidung\" colspan=\"3\">\r\n<div>\r\n\r\nBiển quảng cáo Pano tấm lớn ngoài trời là loại hình quảng cáo băt mắt nhất, thu hút khách hàng quan tâm nhất bởi nó thường được xây dựng tại những khu vực đông người qua lại hoặc tại những công trình xây dựng lớn.\r\n\r\n</div>\r\n<div><img src=\"http://lambienquangcao24h.com/userfiles/pano_tamlon1.jpg\" alt=\"\" width=\"640\" height=\"426\" /></div>\r\n<div>\r\n\r\nBảng biển quảng cáo tấm lớn (pa nô, billboard) là một loại hình bảng đặc biệt, có kích thước lớn, từ khoảng 50m2 (bảng trong nội thành) đến 250m2 (bảng biển trên đường cao tốc, đường quốc lộ, quảng cáo ngoài trời), vì tính chất ảnh hưởng thẩm mỹ và an toàn nên đây là một trong những hình thức bảng hiệu được quản lý chặt chẽ và có quy hoạch chính thức của các cơ quan chức năng\r\n\r\nVề mặt kết cấu, <u>bảng biển quảng cáo tấm lớn</u> (pa nô, billboard) được lắp dựng bởi hệ thống cột cứng, chân cột được chôn sâu, đổ bê tông. Khung bảng bằng sắt vuông hoặc tròn, hàn kết cấu cứng. Mặt bảng thường dùng bạt Hiflex in phun, có thể ốp tole trước khi căng Hiflex hoặc sử dụng các vật liệu cao cấp như tấm hợp kim nhôm.  Ngoài ra, bảng biển quảng cáo tấm lớn (Pano, billboard) còn được thuê chỗ đặt trên các bức tường các căn nhà cao tầng có vị trí đẹp, thuận tiện cho việc quảng cáo (quảng cáo ngoài trời).\r\n\r\n</div>\r\n<div><img src=\"http://lambienquangcao24h.com/userfiles/pano_tamlon2.jpg\" alt=\"\" width=\"640\" height=\"480\" /></div>\r\n<div>\r\n\r\n<strong>Pano, quảng cáo ngoài trời có những đặc tính sau:</strong>\r\n\r\n-      Cường độ truyền đạt mạnh, hiệu quả,.\r\n\r\n-      Mức truyền đạt thông tin liên tục\r\n\r\n-      Tiết kiệm chi phí sản xuất mà vẫn mang lại hiệu quả cao tùy từng tòa nhà mà nhà quảng cáo có thể xây dựng những kích thước biển khác nhau, ít ảnh hưởng bởi gió bão lũ lụt, hay nền móng….\r\n\r\n<strong>Công ty chúng tôi nhận thi công Pano ốp tường – Pano ngoài trời trọn gói, chuyên nghiệp, giá cả cạnh tranh. Qúy khách đến với chúng tôi sẽ yên tâm bởi:</strong>\r\n\r\n-          Thiết kế đẹp, lên bản vẽ một cách nhanh chóng nhờ đội ngũ thiết kế viên chuyên nghiệp.\r\n\r\n-          Thủ tục xin phép nhanh gọn. Thời gian thi công nhanh chóng nhờ đội ngũ nhân viên trẻ, năng động trải nghiệm nhiều qua các công trình.\r\n\r\n-          Sản phẩm bảo đảm bảo về bền vững, đẹp, đáp ứng yêu cầu kỹ thuật, mỹ thuật.\r\n\r\n-          Chế độ bảo hành giúp quý khách yên tâm hơn về dịch vụ của chúng tôi.\r\n\r\n</div>\r\n<div></div></td>\r\n</tr>\r\n</tbody>\r\n</table>','Làm biển pano tấm lớn ngoài trời','','publish','closed','open','','lam-bien-pano-tam-lon-ngoai-troi','','','2016-04-25 09:38:56','2016-04-25 09:38:56','',0,'http://hungphatads.com/?p=92',0,'post','',0),(93,3,'2016-04-25 09:01:09','2016-04-25 09:01:09','','pano_tamlon2','','inherit','closed','closed','','pano_tamlon2','','','2016-04-25 09:01:09','2016-04-25 09:01:09','',92,'http://hungphatads.com/wp-content/uploads/2016/04/pano_tamlon2.jpg',0,'attachment','image/jpeg',0),(94,3,'2016-04-25 09:24:22','2016-04-25 09:24:22','<table class=\"contentpaneopen\">\n<tbody>\n<tr>\n<td class=\"contentheading\" width=\"100%\">QUY TRÌNH ĐẶT HÀNG</td>\n</tr>\n</tbody>\n</table>\n<table class=\"contentpaneopen\">\n<tbody>\n<tr>\n<td valign=\"top\">\n<div>\n\n<a title=\"Công ty quảng cáo Thiết Kế Ý Tưởng\" href=\"http://idesign.com.vn/\">Công ty Quảng cáo và In</a> <strong>HÙNG PHÁT </strong> chân thành cảm ơn quý khách hàng đã quan tâm đến dịch vụ <a title=\"thiết kế thi cong quảng cáo\" href=\"http://idesign.com.vn/\">Thiết kế &amp; Thi công quảng cáo</a> và <a title=\"Nhôm kính Iwindow\" href=\"http://idesign.com.vn/Cong-ty-nhom-kinh-IWINDOW\">In</a> của chúng tôi. Để tạo thuận lợi trong việc giao dịch được nhanh chóng và thuận tiện chúng tôi xin đưa ra qy trình giao dịch như sau:\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td><strong>1. ĐẶT HÀNG TRỰC TUYẾN</strong>\n\n- Quý khách chỉ cần gọi điện thoại trực tiếp đến công ty chúng tôi( Hotline: <strong>0164 980 3432</strong>), để trao đổi và tư vấn về quy cách và hình thức thi công như: chất liệu, vật liệu ...\n\n- Nếu quý khách hàng đã có kích thước, số đo hoặc bản vẽ phác thảo rồi xin vui lòng gửi email cho chúng tôi <b>hungphatads@gmail.com </b>để chúng tôi tiến hành báo giá</td>\n</tr>\n</tbody>\n</table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td><strong>2. KHẢO SÁT THỰC TẾ</strong>\n\n- Sau khi trao đổi và sắp xếp lịch hẹn, chúng tôi sẽ có nhân viên đến địa điểm thi công khảo sát đo đạc thực tế và trao đổi cụ thể hơn với quý khách hàng</td>\n</tr>\n</tbody>\n</table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td><strong>3. THIẾT KẾ MAQUETE</strong>\n\n- Sau khi nắm rõ ý tưởng, quy cách và hình thức thi công. Chúng tôi sẽ thiết kế maket theo yêu cầu của quý khách và trao đổi qua email quý khách cung cấp, nếu có chỉnh sửa sẽ trao đổi qua email cho quý khách</td>\n</tr>\n</tbody>\n</table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td><strong>4. BÁO GIÁ &amp; KÝ HỢP ĐỒNG</strong>\n\n- Sau khi quý khách đã đồng ý bản vẽ thiết kế, chúng tôi sẽ tiến hành làm báo giá và gửi cho quý khách qua email.\n\n- Sau khi quý khách đồng ý theo báo giá quý khách vui lòng ký xác nhận vào báo giá hoặc gửi qua email xác nhận đặt hàng.\n\n- Trong trường hợp nếu đơn hàng nhỏ hơn 20 triệu đồng, báo giá có thể vừa là hợp đồng thi công và không cần làm hợp đồng, chỉ cần hai bên ký xác nhận trên báo giá và mỗi bên giữ 01 (một) hoặc 02 (hai) bản.\n\n- Nếu giá trị hợp đồng tương đối lớn sẽ tiến hành ký kết hợp đồng.</td>\n</tr>\n</tbody>\n</table>\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n<tbody>\n<tr>\n<td><strong>5. THANH TOÁN VÀ NGHIỆM THU</strong>\n\n- Nếu hợp đồng nhỏ hơn 100 triệu đồng, quý khách sẽ chia làm 02 lần thanh toán:\n\n+ Đợt 01: sau khi ký hợp đồng và tiến hành thi công (hoặc đưa vật tư đến địa điểm thi công). Quý khách sẽ thanh toán 50% giá trị hợp đồng.\n\n+ Đợt 02: sau khi thi công hoàn thiện và bàn giao, nghiệm thu. Quý khách thanh toán giá trị hợp đồng còn lại.\n\n- Nếu hợp đồng lớn hơn 100 triệu đồng, quý khách sẽ chia làm 03 lần thanh toán\n\n+ Đợt 01: sau khi ký hợp đồng và tiến hành thi công. Quý khách thanh toán 30% giá trị hợp đồng.\n\n+ Đợt 02: sau khi thi công khoảng 60% khối lượng công trình. Quý khách thanh toán 30% tiếp theo của hợp đồng.\n\n+ Đợt 03: sau khi hoàn thiện và bàn giao, nghiệm thu. Quý khách thanh toán phần còn lại của hợp đồng.</td>\n</tr>\n</tbody>\n</table>\nHÙNG PHÁT hy vọng sẽ tạo sự thuận lợi cho quý khách hàng trong việc giao dịch. Chúc quý khách một ngày làm việc vui vẻ.\n\nChào thân ái\n\n</div></td>\n</tr>\n</tbody>\n</table>','Đặt hàng','','inherit','closed','closed','','23-autosave-v1','','','2016-04-25 09:24:22','2016-04-25 09:24:22','',23,'http://hungphatads.com/23-autosave-v1/',0,'revision','',0),(90,3,'2016-04-25 08:29:26','2016-04-25 08:29:26','','biển chữ nổi','','inherit','closed','closed','','bien-chu-noi','','','2016-04-25 08:29:26','2016-04-25 08:29:26','',85,'http://hungphatads.com/wp-content/uploads/2016/04/biển-chữ-nổi.jpg',0,'attachment','image/jpeg',0),(95,3,'2016-04-25 09:24:54','2016-04-25 09:24:54','<table class=\"contentpaneopen\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" width=\"100%\">QUY TRÌNH ĐẶT HÀNG</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\">\r\n<div>\r\n\r\n<a title=\"Công ty quảng cáo Thiết Kế Ý Tưởng\" href=\"http://idesign.com.vn/\">Công ty Quảng cáo và In</a> <strong>HÙNG PHÁT </strong> chân thành cảm ơn quý khách hàng đã quan tâm đến dịch vụ <a title=\"thiết kế thi cong quảng cáo\" href=\"http://idesign.com.vn/\">Thiết kế &amp; Thi công quảng cáo</a> và <a title=\"Nhôm kính Iwindow\" href=\"http://idesign.com.vn/Cong-ty-nhom-kinh-IWINDOW\">In</a> của chún