itemBody\">\r\n<div class=\"itemFullText\">\r\n\r\n<strong><a title=\"in decal chất lượng cao\" href=\"http://hungphatads.com\" target=\"_blank\">In decal chất lượng cao</a>, <a title=\"in decal ô tô chất lượng cao\" href=\"http://hungphatads.com\" target=\"_blank\"><strong>In decal ô tô chất lượng cao</strong></a></strong>\r\n\r\nIn ấn decal các loại chất lượng cao: in decal phản quang, in decal pp, in decal trong pvc, in decal ôtô, in decal lưới, in decal giấy, in decal nhựa các loại...\r\n\r\nDecal thường được dùng để cắt chữ và hoa văn để trang trí. Ngày nay, với công nghệ tiên tiến, chúng ta có thể in trên decal tất cả những hình ảnh, hoa văn, họa tiết mà chúng ta muốn có. Decal sau khi in có thể trang trí cho Laptop, tường nhà, phương tiện giao thông, trên mọi vật liệu với độ bền cao và màu sắc trung thực. Decal chuyên thiết kế in ấn và dán decal các loại, với hệ thống máy in decal chuyên dụng dễ dàng đáp ứng đầy đủ nhu cầu của Quý khách\r\n\r\n<img src=\"http://inbat.com.vn/images/in-decal-chat-luong-cao.jpg\" alt=\"in-decal-chat-luong-cao\" width=\"550\" height=\"458\" />\r\n\r\n&nbsp;\r\n\r\n</div>\r\n</div>','in và dán decal ô tô','','publish','closed','open','','va-dan-decal-o','','','2016-04-27 07:03:05','2016-04-27 07:03:05','',0,'http://hungphatads.com/?p=132',0,'post','',0),(133,3,'2016-04-27 07:02:43','2016-04-27 07:02:43','','tải xuống','','inherit','closed','closed','','tai-xuong','','','2016-04-27 07:02:43','2016-04-27 07:02:43','',132,'http://hungphatads.com/wp-content/uploads/2016/04/tải-xuống.jpg',0,'attachment','image/jpeg',0),(134,3,'2016-04-27 07:03:05','2016-04-27 07:03:05','<div class=\"itemHeader\">\r\n<div class=\"itemToolbar\">\r\n<h1 class=\"itemTitle\">In decal ô tô chất lượng cao</h1>\r\n</div>\r\n</div>\r\n<div class=\"itemBody\">\r\n<div class=\"itemFullText\">\r\n\r\n<strong><a title=\"in decal chất lượng cao\" href=\"http://hungphatads.com\" target=\"_blank\">In decal chất lượng cao</a>, <a title=\"in decal ô tô chất lượng cao\" href=\"http://hungphatads.com\" target=\"_blank\"><strong>In decal ô tô chất lượng cao</strong></a></strong>\r\n\r\nIn ấn decal các loại chất lượng cao: in decal phản quang, in decal pp, in decal trong pvc, in decal ôtô, in decal lưới, in decal giấy, in decal nhựa các loại...\r\n\r\nDecal thường được dùng để cắt chữ và hoa văn để trang trí. Ngày nay, với công nghệ tiên tiến, chúng ta có thể in trên decal tất cả những hình ảnh, hoa văn, họa tiết mà chúng ta muốn có. Decal sau khi in có thể trang trí cho Laptop, tường nhà, phương tiện giao thông, trên mọi vật liệu với độ bền cao và màu sắc trung thực. Decal chuyên thiết kế in ấn và dán decal các loại, với hệ thống máy in decal chuyên dụng dễ dàng đáp ứng đầy đủ nhu cầu của Quý khách\r\n\r\n<img src=\"http://inbat.com.vn/images/in-decal-chat-luong-cao.jpg\" alt=\"in-decal-chat-luong-cao\" width=\"550\" height=\"458\" />\r\n\r\n&nbsp;\r\n\r\n</div>\r\n</div>','in và dán decal ô tô','','inherit','closed','closed','','132-revision-v1','','','2016-04-27 07:03:05','2016-04-27 07:03:05','',132,'http://hungphatads.com/132-revision-v1/',0,'revision','',0),(135,3,'2016-04-27 12:58:43','2016-04-27 12:58:43','Đặt hàng Hotline: 0164 980 3432\r\n\r\nTờ rơi là vật phẩm quảng cáo đã được sử dụng từ rất lâu, cho đến hiện nay, tờ rơi, tờ gấp vẫn giữ được vai trò quảng cáo hiệu quả của mình. Thuộc nhóm in ấn quảng cáo ngoài trời, in số lượng lớn nên tờ rơi, tờ gấp được <strong>In Kỹ Thuật Số </strong>thực hiện với công nghệ in offset, in số lượng lớn tiết kiệm.\r\n\r\n<strong>Khách hàng đặt in tờ rơi, tờ gấp dùng cho những dịp gì?</strong>\r\n\r\nTờ rơi, tờ gấp được khách hàng đặt in tại <strong>In Kỹ Thuật Số </strong>sử dụng cho các hoạt động quảng cáo ngoài trời, quảng cáo sự kiện, hội chợ, triển lãm các loại, cụ thể gồm có:\r\n<ul>\r\n	<li>In tờ rơi phát ngoài trời quảng bá các chương trình học tập, các lớp học kỹ năng, năng khiếu, các khóa học tự chọn</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi kết hợp menu giới thiệu sản phẩm, dịch vụ từ cửa hàng thức ăn nhanh, cửa hàng bánh kẹo, quán café, cửa hàng làm tóc, nail, thẩm mỹ</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi kết hợp giới thiệu dịch vụ giao hàng tận nhà, gọi món giao tại nhà của các cửa hàng, được phát ngoài trời hoặc gửi kèm đơn hàng giao nhận</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi giới thiệu chương trình khuyến mãi, giảm giá sản phẩm</li>\r\n</ul>\r\n<ul>\r\n	<li>In tơ rơi giới thiệu chương trình sự kiện, chương trình hội nghị, hội chợ,…</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi giới thiệu dự án nhà đất, dự án bất động sản,…</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi quảng bá sự kiện nhóm, các buổi chợ phiên, chợ handmade</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi giới thiệu sản phẩm cho các công ty, đơn vị, doanh nghiệp</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi giới thiệu chương trình tuyển sinh, chương trình học cho các trường đại học, cao đẳng, trung cấp, trung học thực hành, các trung tâm tiếng Anh, vi tính; các khóa học chứng chỉ,…</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi kết hợp menu/thực đơn, tờ rơi kết hợp voucher, tờ rơi kết hợp phiếu quà tặng, phiếu giảm giá, phiếu ưu đãi mua hàng</li>\r\n</ul>\r\nHầu như các chương trình khuyến mãi, quảng bá, giới thiệu, sự kiện đều cần đến tờ rơi, tờ gấp như một cách thức quảng bá trực tiếp đến mọi người, do đó, nếu bạn cần đến một đơn vị thực hiện in tờ rơi số lượng lớn, in tờ rơi định kỳ hàng tháng, quý, năm, hãy liên hệ ngay <strong>In Kỹ Thuật Số </strong>để nhận được mức giá in ưu đãi nhất tại HN.\r\n\r\n<img src=\"http://cdn.inkythuatso.com/asset/home/img/500/55a642049b505_1436959236.jpg\" alt=\"\" width=\"500\" height=\"375\" />\r\n\r\n<strong>In tờ rơi được thực hiện như thế nào tại In Kỹ Thuật Số?</strong>\r\n\r\nCách thức <strong>In Kỹ Thuật Số </strong>thực hiện đơn hàng in tờ rơi thông thường là in offset số lượng lớn, đặt in từ 500 – 1000 – 2000 – 5000 – 10.0000… tờ rơi trở lên, dựa trên tiêu chí: số lượng đặt in tờ rơi, tờ gấp càng nhiều, giá in trên từng tờ rơi, tờ gấp càng giảm.\r\n\r\nVới đơn hàng số lượng lớn, in offset là giải pháp in ấn tốt nhất, không những đáp ứng được số lượng lớn tờ rơi cần in trong một lần in, mà còn mang đến giá in trên từng sản phẩm rẻ hơn bất kỳ cách thức in nào khác. Không những thế, thành phẩm in tờ rơi đồng đều, màu sắc chính xác, chất lượng in ấn được đảm bảo.\r\n\r\nTuy nhiên, trong một số trường hợp khách hàng chỉ muốn đặt in tờ rơi, tờ gấp với số lượng ít, in số lượng hạn chế cho mục đích sử dụng riêng, <strong>In Kỹ Thuật Số </strong>đều vẫn thực hiện in cho bạn, nhưng sử dụng công nghệ in phun kỹ thuật số.\r\n\r\n<strong>Gia công cho in tờ rơi, tờ gấp thực hiện tại In Kỹ Thuật Số gồm những loại hình nào?</strong>\r\n\r\nTờ rơi, tờ gấp mà bạn thường được nhận thật sự đã được qua các công đoạn gia công riêng, chi tiết có các cách thức gia công tờ rơi, tờ gấp như sau:\r\n<ul>\r\n	<li>Gia công cán màng: cán màng bóng hoặc màng mờ bảo vệ bề mặt in, gia công cán màng được thực hiện đầu tiên, sau đó mới đến các loại hình gia công khác</li>\r\n</ul>\r\n<ul>\r\n	<li>Gia công cắt: tờ rơi sau in là một tấm lớn gồm nhiều tờ rơi đặt cạnh nhau, cắt là công đoạn gia công bắt buộc để cắt rời từng tờ rơi ra</li>\r\n</ul>\r\n<ul>\r\n	<li>Gia công cấn: đối với tờ rơi gấp hoặc với tờ gấp, nếp gấp bạn thấy không phải là gấp bằng tay mà được thực hiện bằng máy, đặc điểm, đường gấp dứt khoát, đều, thẳng</li>\r\n</ul>\r\n<ul>\r\n	<li>Gia công bế: bế tờ rơi theo hình dạng yêu cầu, nhiều tờ rơi bạn thấy có hình tròn, hình tam giác, hình nhân vật,… chứng tỏ chúng đã được gia công bế</li>\r\n</ul>\r\n<ul>\r\n	<li>Gia công phủ UV: dùng cho in tờ rơi cao cấp, vị trí phủ UV sẽ trông bóng bẩy, thường phủ UV là logo, đặc điểm nhận dạng hoặc hoa văn riêng</li>\r\n</ul>\r\n<img src=\"http://cdn.inkythuatso.com/asset/home/img/500/55a6421d39750_1436959261.jpg\" alt=\"\" width=\"500\" height=\"375\" />\r\n\r\n<em>Tờ rơi đã được gia công cấn đường thẳng tại <strong>In Kỹ Thuật Số </strong></em>\r\n\r\n<strong>Nguyên vật liệu cho in tờ rơi thực hiện tại In Kỹ Thuật Số gồm có những gì?</strong>\r\n\r\nVề cơ bản, để thực hiện in tờ rơi, tờ gấp thì giấy in là nguyên liệu quan trọng nhất; tờ rơi có đặc điểm mỏng, nhẹ do được đặt in trên các chất liệu giấy có định lượng thấp (dưới 300gsm), cụ thể:\r\n<ul>\r\n	<li>Giấy Ford: chính là loại giấy A4 sử dụng thường ngày, chuyên dùng cho in tờ rơi giá rẻ, in tờ rơi thường, giấy chưa qua tráng phủ</li>\r\n</ul>\r\n<ul>\r\n	<li>Giấy coucher: loại giấy đã qua tráng phủ: chạm vào bề mặt sẽ mịn, trơn, không cảm thấy sần như Ford</li>\r\n</ul>\r\n<ul>\r\n	<li>Giấy coucher matt: giống Coucher nhưng không bắt ánh sáng, khi nhìn vào không bị chói mắt</li>\r\n</ul>\r\n<ul>\r\n	<li>Ngoài ra, giấy Bristol cũng thường được dùng cho in tờ rơi, tờ gấp</li>\r\n</ul>\r\nNgoài giấy in, màng dùng cho gia công cũng được tính như một nguyên vật liệu in ấn, màng là lớp PVC kéo mỏng, loại bóng hoặc mờ tùy yêu cầu đặt in tờ rơi, tờ gấp của khách hàng.\r\n\r\n<strong>Cách tính giá in tờ rơi từ In Kỹ Thuật Số?</strong>\r\n\r\nTờ rơi được tính giá dựa trên số lượng in, chất liệu, gia công, quy cách in ấn,… cụ thể, bạn cùng <strong>In Kỹ Thuật Số </strong>tham khảo qua các yếu tố quyết định đến giá thành in tờ rơi sau:\r\n<ul>\r\n	<li>Số lượng in tờ rơi là bao nhiêu? Thường tờ rơi sẽ có các mốc số lượng in chẳn như 500, 1000, 2000, 3000, 5000, 7000, 10.000 để khách lựa chọn đặt in cũng như giúp nhân viên kinh doanh tính giá chính xác nhất</li>\r\n</ul>\r\n<ul>\r\n	<li>Kích thước in tờ rơi, tờ gấp: bởi kích thước ảnh hưởng đến khổ giấy cùng bản kẽm</li>\r\n</ul>\r\n<ul>\r\n	<li>In offset hay in kỹ thuật số, in một mặt hay hai mặt</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi là in trắng đen, một màu, hai màu, bốn màu hay full màu</li>\r\n</ul>\r\n<ul>\r\n	<li>Gia công tờ rơi: cán màng, cắt, bế, cấn, phủ UV, xếp,…</li>\r\n</ul>\r\n<ul>\r\n	<li>Công in tờ rơi</li>\r\n</ul>\r\n<ul>\r\n	<li>Chất liệu giấy dùng cho in tờ rơi, tờ gấp</li>\r\n</ul>\r\n<ul>\r\n	<li>Bản kẽm, phim in (cho in offset số lượng lớn, còn in phun thì không có phần này)</li>\r\n</ul>\r\n<ul>\r\n	<li>Thiết kế: nếu khách hàng cần thiết kế riêng</li>\r\n</ul>\r\n<ul>\r\n	<li>Giao hàng: đơn hàng trong nội thành TPHCM giao miễn phí, ngoại thành hoặc tỉnh có tính phí</li>\r\n</ul>\r\n<strong>Hình ảnh trực tiếp in tờ rơi, tờ gấp tại In Kỹ Thuật Số</strong>\r\n\r\n<img src=\"http://cdn.inkythuatso.com/asset/home/img/500/55a6425c078df_1436959324.jpg\" alt=\"\" width=\"500\" height=\"375\" />\r\n\r\nĐặt in tờ rơi, tờ gấp tại <strong>In Kỹ Thuật Số </strong>bạn nhận được dịch vụ in ấn chất lượng, in số lượng lớn với công nghệ in offset chuyên dụng. Chỉ với thao tác gửi email đặt in (trong email có để thông tin liên hệ, số điện thoại của bạn) nhân viên kinh doanh của <strong>In Kỹ Thuật Số </strong>sẽ hồi âm và gọi điện báo giá, tư vấn in cho bạn.\r\n\r\nVới kinh nghiệm hơn 10 năm trong hoạt động in ấn quảng cáo, in tờ rơi, <strong>In Kỹ Thuật Số </strong>tự tin mang đến cho bạn tờ rơi, tờ gấp in ấn chất lượng, đồng đều, sử dụng hiệu quả. Hỗ trợ bạn tối đa trong việc đặt in tờ rơi với dịch vụ thiết kế, dịch vụ giao hàng nhanh.\r\n\r\nHUNGPHATADS.COM','in tờ rơi - tờ gấp','','publish','closed','open','','decal-trong-dan-decal-kinh','','','2016-04-27 12:58:43','2016-04-27 12:58:43','',0,'http://hungphatads.com/?p=135',0,'post','',0),(136,3,'2016-04-27 07:07:58','2016-04-27 07:07:58','','140717093610PMdecal trog','','inherit','closed','closed','','140717093610pmdecal-trog','','','2016-04-27 07:07:58','2016-04-27 07:07:58','',135,'http://hungphatads.com/wp-content/uploads/2016/04/140717093610PMdecal-trog.jpg',0,'attachment','image/jpeg',0),(137,3,'2016-04-27 12:58:33','2016-04-27 12:58:33','','in-to-roi','','inherit','closed','closed','','in-to-roi','','','2016-04-27 12:58:33','2016-04-27 12:58:33','',135,'http://hungphatads.com/wp-content/uploads/2016/04/in-to-roi.jpg',0,'attachment','image/jpeg',0),(138,3,'2016-04-27 12:58:43','2016-04-27 12:58:43','Đặt hàng Hotline: 0164 980 3432\r\n\r\nTờ rơi là vật phẩm quảng cáo đã được sử dụng từ rất lâu, cho đến hiện nay, tờ rơi, tờ gấp vẫn giữ được vai trò quảng cáo hiệu quả của mình. Thuộc nhóm in ấn quảng cáo ngoài trời, in số lượng lớn nên tờ rơi, tờ gấp được <strong>In Kỹ Thuật Số </strong>thực hiện với công nghệ in offset, in số lượng lớn tiết kiệm.\r\n\r\n<strong>Khách hàng đặt in tờ rơi, tờ gấp dùng cho những dịp gì?</strong>\r\n\r\nTờ rơi, tờ gấp được khách hàng đặt in tại <strong>In Kỹ Thuật Số </strong>sử dụng cho các hoạt động quảng cáo ngoài trời, quảng cáo sự kiện, hội chợ, triển lãm các loại, cụ thể gồm có:\r\n<ul>\r\n	<li>In tờ rơi phát ngoài trời quảng bá các chương trình học tập, các lớp học kỹ năng, năng khiếu, các khóa học tự chọn</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi kết hợp menu giới thiệu sản phẩm, dịch vụ từ cửa hàng thức ăn nhanh, cửa hàng bánh kẹo, quán café, cửa hàng làm tóc, nail, thẩm mỹ</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi kết hợp giới thiệu dịch vụ giao hàng tận nhà, gọi món giao tại nhà của các cửa hàng, được phát ngoài trời hoặc gửi kèm đơn hàng giao nhận</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi giới thiệu chương trình khuyến mãi, giảm giá sản phẩm</li>\r\n</ul>\r\n<ul>\r\n	<li>In tơ rơi giới thiệu chương trình sự kiện, chương trình hội nghị, hội chợ,…</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi giới thiệu dự án nhà đất, dự án bất động sản,…</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi quảng bá sự kiện nhóm, các buổi chợ phiên, chợ handmade</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi giới thiệu sản phẩm cho các công ty, đơn vị, doanh nghiệp</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi giới thiệu chương trình tuyển sinh, chương trình học cho các trường đại học, cao đẳng, trung cấp, trung học thực hành, các trung tâm tiếng Anh, vi tính; các khóa học chứng chỉ,…</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi kết hợp menu/thực đơn, tờ rơi kết hợp voucher, tờ rơi kết hợp phiếu quà tặng, phiếu giảm giá, phiếu ưu đãi mua hàng</li>\r\n</ul>\r\nHầu như các chương trình khuyến mãi, quảng bá, giới thiệu, sự kiện đều cần đến tờ rơi, tờ gấp như một cách thức quảng bá trực tiếp đến mọi người, do đó, nếu bạn cần đến một đơn vị thực hiện in tờ rơi số lượng lớn, in tờ rơi định kỳ hàng tháng, quý, năm, hãy liên hệ ngay <strong>In Kỹ Thuật Số </strong>để nhận được mức giá in ưu đãi nhất tại HN.\r\n\r\n<img src=\"http://cdn.inkythuatso.com/asset/home/img/500/55a642049b505_1436959236.jpg\" alt=\"\" width=\"500\" height=\"375\" />\r\n\r\n<strong>In tờ rơi được thực hiện như thế nào tại In Kỹ Thuật Số?</strong>\r\n\r\nCách thức <strong>In Kỹ Thuật Số </strong>thực hiện đơn hàng in tờ rơi thông thường là in offset số lượng lớn, đặt in từ 500 – 1000 – 2000 – 5000 – 10.0000… tờ rơi trở lên, dựa trên tiêu chí: số lượng đặt in tờ rơi, tờ gấp càng nhiều, giá in trên từng tờ rơi, tờ gấp càng giảm.\r\n\r\nVới đơn hàng số lượng lớn, in offset là giải pháp in ấn tốt nhất, không những đáp ứng được số lượng lớn tờ rơi cần in trong một lần in, mà còn mang đến giá in trên từng sản phẩm rẻ hơn bất kỳ cách thức in nào khác. Không những thế, thành phẩm in tờ rơi đồng đều, màu sắc chính xác, chất lượng in ấn được đảm bảo.\r\n\r\nTuy nhiên, trong một số trường hợp khách hàng chỉ muốn đặt in tờ rơi, tờ gấp với số lượng ít, in số lượng hạn chế cho mục đích sử dụng riêng, <strong>In Kỹ Thuật Số </strong>đều vẫn thực hiện in cho bạn, nhưng sử dụng công nghệ in phun kỹ thuật số.\r\n\r\n<strong>Gia công cho in tờ rơi, tờ gấp thực hiện tại In Kỹ Thuật Số gồm những loại hình nào?</strong>\r\n\r\nTờ rơi, tờ gấp mà bạn thường được nhận thật sự đã được qua các công đoạn gia công riêng, chi tiết có các cách thức gia công tờ rơi, tờ gấp như sau:\r\n<ul>\r\n	<li>Gia công cán màng: cán màng bóng hoặc màng mờ bảo vệ bề mặt in, gia công cán màng được thực hiện đầu tiên, sau đó mới đến các loại hình gia công khác</li>\r\n</ul>\r\n<ul>\r\n	<li>Gia công cắt: tờ rơi sau in là một tấm lớn gồm nhiều tờ rơi đặt cạnh nhau, cắt là công đoạn gia công bắt buộc để cắt rời từng tờ rơi ra</li>\r\n</ul>\r\n<ul>\r\n	<li>Gia công cấn: đối với tờ rơi gấp hoặc với tờ gấp, nếp gấp bạn thấy không phải là gấp bằng tay mà được thực hiện bằng máy, đặc điểm, đường gấp dứt khoát, đều, thẳng</li>\r\n</ul>\r\n<ul>\r\n	<li>Gia công bế: bế tờ rơi theo hình dạng yêu cầu, nhiều tờ rơi bạn thấy có hình tròn, hình tam giác, hình nhân vật,… chứng tỏ chúng đã được gia công bế</li>\r\n</ul>\r\n<ul>\r\n	<li>Gia công phủ UV: dùng cho in tờ rơi cao cấp, vị trí phủ UV sẽ trông bóng bẩy, thường phủ UV là logo, đặc điểm nhận dạng hoặc hoa văn riêng</li>\r\n</ul>\r\n<img src=\"http://cdn.inkythuatso.com/asset/home/img/500/55a6421d39750_1436959261.jpg\" alt=\"\" width=\"500\" height=\"375\" />\r\n\r\n<em>Tờ rơi đã được gia công cấn đường thẳng tại <strong>In Kỹ Thuật Số </strong></em>\r\n\r\n<strong>Nguyên vật liệu cho in tờ rơi thực hiện tại In Kỹ Thuật Số gồm có những gì?</strong>\r\n\r\nVề cơ bản, để thực hiện in tờ rơi, tờ gấp thì giấy in là nguyên liệu quan trọng nhất; tờ rơi có đặc điểm mỏng, nhẹ do được đặt in trên các chất liệu giấy có định lượng thấp (dưới 300gsm), cụ thể:\r\n<ul>\r\n	<li>Giấy Ford: chính là loại giấy A4 sử dụng thường ngày, chuyên dùng cho in tờ rơi giá rẻ, in tờ rơi thường, giấy chưa qua tráng phủ</li>\r\n</ul>\r\n<ul>\r\n	<li>Giấy coucher: loại giấy đã qua tráng phủ: chạm vào bề mặt sẽ mịn, trơn, không cảm thấy sần như Ford</li>\r\n</ul>\r\n<ul>\r\n	<li>Giấy coucher matt: giống Coucher nhưng không bắt ánh sáng, khi nhìn vào không bị chói mắt</li>\r\n</ul>\r\n<ul>\r\n	<li>Ngoài ra, giấy Bristol cũng thường được dùng cho in tờ rơi, tờ gấp</li>\r\n</ul>\r\nNgoài giấy in, màng dùng cho gia công cũng được tính như một nguyên vật liệu in ấn, màng là lớp PVC kéo mỏng, loại bóng hoặc mờ tùy yêu cầu đặt in tờ rơi, tờ gấp của khách hàng.\r\n\r\n<strong>Cách tính giá in tờ rơi từ In Kỹ Thuật Số?</strong>\r\n\r\nTờ rơi được tính giá dựa trên số lượng in, chất liệu, gia công, quy cách in ấn,… cụ thể, bạn cùng <strong>In Kỹ Thuật Số </strong>tham khảo qua các yếu tố quyết định đến giá thành in tờ rơi sau:\r\n<ul>\r\n	<li>Số lượng in tờ rơi là bao nhiêu? Thường tờ rơi sẽ có các mốc số lượng in chẳn như 500, 1000, 2000, 3000, 5000, 7000, 10.000 để khách lựa chọn đặt in cũng như giúp nhân viên kinh doanh tính giá chính xác nhất</li>\r\n</ul>\r\n<ul>\r\n	<li>Kích thước in tờ rơi, tờ gấp: bởi kích thước ảnh hưởng đến khổ giấy cùng bản kẽm</li>\r\n</ul>\r\n<ul>\r\n	<li>In offset hay in kỹ thuật số, in một mặt hay hai mặt</li>\r\n</ul>\r\n<ul>\r\n	<li>In tờ rơi là in trắng đen, một màu, hai màu, bốn màu hay full màu</li>\r\n</ul>\r\n<ul>\r\n	<li>Gia công tờ rơi: cán màng, cắt, bế, cấn, phủ UV, xếp,…</li>\r\n</ul>\r\n<ul>\r\n	<li>Công in tờ rơi</li>\r\n</ul>\r\n<ul>\r\n	<li>Chất liệu giấy dùng cho in tờ rơi, tờ gấp</li>\r\n</ul>\r\n<ul>\r\n	<li>Bản kẽm, phim in (cho in offset số lượng lớn, còn in phun thì không có phần này)</li>\r\n</ul>\r\n<ul>\r\n	<li>Thiết kế: nếu khách hàng cần thiết kế riêng</li>\r\n</ul>\r\n<ul>\r\n	<li>Giao hàng: đơn hàng trong nội thành TPHCM giao miễn phí, ngoại thành hoặc tỉnh có tính phí</li>\r\n</ul>\r\n<strong>Hình ảnh trực tiếp in tờ rơi, tờ gấp tại In Kỹ Thuật Số</strong>\r\n\r\n<img src=\"http://cdn.inkythuatso.com/asset/home/img/500/55a6425c078df_1436959324.jpg\" alt=\"\" width=\"500\" height=\"375\" />\r\n\r\nĐặt in tờ rơi, tờ gấp tại <strong>In Kỹ Thuật Số </strong>bạn nhận được dịch vụ in ấn chất lượng, in số lượng lớn với công nghệ in offset chuyên dụng. Chỉ với thao tác gửi email đặt in (trong email có để thông tin liên hệ, số điện thoại của bạn) nhân viên kinh doanh của <strong>In Kỹ Thuật Số </strong>sẽ hồi âm và gọi điện báo giá, tư vấn in cho bạn.\r\n\r\nVới kinh nghiệm hơn 10 năm trong hoạt động in ấn quảng cáo, in tờ rơi, <strong>In Kỹ Thuật Số </strong>tự tin mang đến cho bạn tờ rơi, tờ gấp in ấn chất lượng, đồng đều, sử dụng hiệu quả. Hỗ trợ bạn tối đa trong việc đặt in tờ rơi với dịch vụ thiết kế, dịch vụ giao hàng nhanh.\r\n\r\nHUNGPHATADS.COM','in tờ rơi - tờ gấp','','inherit','closed','closed','','135-revision-v1','','','2016-04-27 12:58:43','2016-04-27 