 vật liệu ...\r\n\r\n- Nếu quý khách hàng đã có kích thước, số đo hoặc bản vẽ phác thảo rồi xin vui lòng gửi email cho chúng tôi <b>hungphatads@gmail.com </b>để chúng tôi tiến hành báo giá</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td><strong>2. KHẢO SÁT THỰC TẾ</strong>\r\n\r\n- Sau khi trao đổi và sắp xếp lịch hẹn, chúng tôi sẽ có nhân viên đến địa điểm thi công khảo sát đo đạc thực tế và trao đổi cụ thể hơn với quý khách hàng</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td><strong>3. THIẾT KẾ MAQUETE</strong>\r\n\r\n- Sau khi nắm rõ ý tưởng, quy cách và hình thức thi công. Chúng tôi sẽ thiết kế maket theo yêu cầu của quý khách và trao đổi qua email quý khách cung cấp, nếu có chỉnh sửa sẽ trao đổi qua email cho quý khách</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td><strong>4. BÁO GIÁ &amp; KÝ HỢP ĐỒNG</strong>\r\n\r\n- Sau khi quý khách đã đồng ý bản vẽ thiết kế, chúng tôi sẽ tiến hành làm báo giá và gửi cho quý khách qua email.\r\n\r\n- Sau khi quý khách đồng ý theo báo giá quý khách vui lòng ký xác nhận vào báo giá hoặc gửi qua email xác nhận đặt hàng.\r\n\r\n- Trong trường hợp nếu đơn hàng nhỏ hơn 20 triệu đồng, báo giá có thể vừa là hợp đồng thi công và không cần làm hợp đồng, chỉ cần hai bên ký xác nhận trên báo giá và mỗi bên giữ 01 (một) hoặc 02 (hai) bản.\r\n\r\n- Nếu giá trị hợp đồng tương đối lớn sẽ tiến hành ký kết hợp đồng.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td><strong>5. THANH TOÁN VÀ NGHIỆM THU</strong>\r\n\r\n- Nếu hợp đồng nhỏ hơn 100 triệu đồng, quý khách sẽ chia làm 02 lần thanh toán:\r\n\r\n+ Đợt 01: sau khi ký hợp đồng và tiến hành thi công (hoặc đưa vật tư đến địa điểm thi công). Quý khách sẽ thanh toán 50% giá trị hợp đồng.\r\n\r\n+ Đợt 02: sau khi thi công hoàn thiện và bàn giao, nghiệm thu. Quý khách thanh toán giá trị hợp đồng còn lại.\r\n\r\n- Nếu hợp đồng lớn hơn 100 triệu đồng, quý khách sẽ chia làm 03 lần thanh toán\r\n\r\n+ Đợt 01: sau khi ký hợp đồng và tiến hành thi công. Quý khách thanh toán 30% giá trị hợp đồng.\r\n\r\n+ Đợt 02: sau khi thi công khoảng 60% khối lượng công trình. Quý khách thanh toán 30% tiếp theo của hợp đồng.\r\n\r\n+ Đợt 03: sau khi hoàn thiện và bàn giao, nghiệm thu. Quý khách thanh toán phần còn lại của hợp đồng.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<strong>HÙNG PHÁT</strong> hy vọng sẽ tạo sự thuận lợi cho quý khách hàng trong việc giao dịch. Chúc quý khách một ngày làm việc vui vẻ.\r\n\r\nChào thân ái\r\n\r\n======================\r\n\r\n<strong>CÔNG TY TNHH TM &amp; QUẢNG CÁO HÙNG PHÁT</strong>\r\n\r\n<em>Địa chỉ: Số 9, ngõ 39,Đình Thôn, Mỹ Đình, Hà Nội </em>\r\n\r\nHotline: 01649803432  - 0982030255\r\n\r\nEmail: hungphatads@gmail.com\r\n\r\nSkype: trananh.hn133\r\n\r\nFanpge: https://www.facebook.com/bienquangcaohungphatads/?fref=ts\r\n\r\n</div></td>\r\n</tr>\r\n</tbody>\r\n</table>','Quy trình đặt hàng','','inherit','closed','closed','','23-revision-v1','','','2016-06-08 03:57:23','2016-06-08 03:57:23','',23,'http://hungphatads.com/23-revision-v1/',0,'revision','',0),(206,1,'2016-06-08 03:59:31','0000-00-00 00:00:00','','test','','draft','closed','closed','','test','','','2016-06-08 03:59:31','2016-06-08 03:59:31','',0,'http://hungphatads.com/?page_id=206',0,'page','',0),(207,1,'2016-06-08 03:59:31','2016-06-08 03:59:31','','test','','inherit','closed','closed','','206-revision-v1','','','2016-06-08 03:59:31','2016-06-08 03:59:31','',206,'http://hungphatads.com/206-revision-v1/',0,'revision','',0),(210,3,'2016-07-05 02:45:59','2016-07-05 02:45:59','<span style=\"color: #ff0000;\"><strong><a style=\"color: #ff0000;\" href=\"http://hungphatads.com/bien-alu-gan-chu-noi/\">Biển Alu chữ nổi</a></strong></span>\n\n- Đây là gương mặt của một công ty, doa