INSERT INTO `wp_term_taxonomy` VALUES (1,1,'category','',0,15),(2,2,'nav_menu','',0,5),(3,3,'category','<h1 style=\"text-align: center;\"><span style=\"color: #800000;\">BIỂN QUẢNG CÁO</span></h1>\r\nVới  đội ngũ nhân viên thiết kế - thi công trong nghành quảng cáo nhiệt tình, có tay nghề cao, luôn đảm bảo về chất lượng tốt nhất. Thi công nhanh chóng, có báo hành công trình sản phẩm.\r\n\r\nHùng Phát không ngừng phát huy sự sáng tạo, những sản phẩm mới có tính marketing cao, chi phí thấp\r\n<h2><span style=\"color: #00ff00;\">Một số sản phẩm nổi bật tại Hùng phát:</span></h2>\r\n+ Pano quảng cáo bằng bạt, in biển bạt\r\n+ Màn hình Led, bảng điện tử, cổng chào\r\n+ Quảng cáo Ledsign, led ma trận\r\n+ Mặt dựng alu, bảng hiệu quảng cáo, bảng hiệu alu , hộp đèn 3M, neonsign\r\n+ Chữ nổi led, Inox, Mica\r\n\r\n- Làm biển ốp alu cửa hàng, showroom, ốp alu mặt nội thất\r\n- Biển hộp đèn :bạt, alu, mica, lắp đèn chiếu sang\r\n- Biển đèn LED, LED chữ chạy.\r\n- Biển quảng cáo chữ nổi: biển alu chữ nổi, mica chữ nổi, formex chữ nổi\r\n- Biển backdrop lễ tân, biển công ty lễ tân\r\n- Biển vẫy, biển chào hàng, biển hộp đèn hút nổi\r\n- Biển bạt hiflex, background sân khấu, pano khổ lớn\r\n- Biển tên phòng, biển tên công ty, biển chức danh: mica,alu, đồng, inox ,tôn\r\n- Gia công quầy kệ: meu chữ T,meu chữ L, menu đế rút, hộp mica, kệ mica, hòm phiếu, thùng phiếu\r\n- In ấn giá rẻ: in bạt hiflex, in decal, in card visit, in tờ rơi, tờ gấp, in ấn trên mọi chất liệu\r\n<h2><span style=\"color: #00ff00;\">Làm Biển quảng cáo tại Quảng cáo Hùng Phát: </span></h2>\r\n+ Được tư vấn cách chọn vật liệu phù hợp với giá thành và độ bền\r\n\r\n+Giá luôn cạnh tranh\r\n\r\n+ Chất lượng phục vụ tốt - uy tín - nhiệt tình\r\n\r\n+ Luôn mang lại sản phẩm tốt làm hài lòng Quý khách\r\n\r\n<strong><span style=\"color: #ff6600;\">HOTLINE: 091 588 65 33 </span></strong>\r\n\r\n&nbsp;',0,6),(4,4,'category','',3,2),(5,5,'category','<h1><span style=\"color: #ff0000;\">Biển tên công ty: </span></h1>\r\n<h2>Quy cách làm biển tên công ty:</h2>\r\nChất liệu sử dụng để làm những <span style=\"text-decoration: underline;\"><em><strong>biển tên công ty</strong></em></span>: mica, đồng ăn mòn, inox ăn mòn, ngoài ra ở một số doanh nghiệp dùng những vật liệu khác, cách điệu, dùng inox kết hợp với da, mica lắp chữ nổi thắp đèn.\r\n<h3>Biển tên công ty có 2 loại: biển tên để ngoài cửa văn phòng và biển tên ở trong sảnh, trong văn phòng () Hay còn gọi là background công ty)</h3>\r\n+ Với biển tên ngoài cửa công ty kích thước thường dùng ở các doanh nghiệp hiện nay là 30 x 40 cm, có thể làm bằng mica dán decal, mica phun sơn, nếu doanh nghiệp nào muốn sang trọng hơn đẹp hơn có thể dùng biển tên công ty bằng inox hoặc đồng ăn mòn\r\n\r\n+Biển tên công ty đặt trong văn phòng(background) thì kích thước tùy vào vị trí đặt mỗi doanh nghiệp, biển đẹp sang trọng, mặt biển có thẻ làm bằng kính hoặc bằng mica 5mm - 10 mm, nội dung trên biển có thẻ làm khắc cnc phun sơn, hoặc làm chữ nổi lắp đèn sáng\r\n<h2><strong>Tại sao nên chọn Quảng cáo Hùng Phát làm biển tên công ty?</strong></h2>\r\nCông ty Quảng cáo Hùng Phát là một đơn vị hàng đầu chuyên biển quảng cáo: Với sự sáng tạo không ngừng để tạo ra những sản phẩm đẹp bền giá cả phải chăng. Với biển tên công ty thì Quảng cáo Hùng phát luôn đem lại sự thành công trong thiết kế - thi công - giá cạnh tranh.\r\n\r\nQuý khách có nhu cầu cần tư vấn về biển quảng cáo biển tên công ty\r\n<h4><span style=\"color: #ff0000;\">Hotline: <strong>091 533 65 33</strong></span></h4>',3,4),(6,6,'category','',0,8),(7,7,'nav_menu','',0,14),(9,9,'post_tag','',0,1),(10,10,'post_tag','',0,1),(11,11,'post_tag','',0,1),(12,12,'post_tag','',0,1),(13,13,'post_tag','',0,1),(14,14,'category','',0,2),(15,15,'category','',0,1),(17,17,'category','',0,1),(18,18,'category','',0,0),(19,19,'category','',3,0),(20,20,'category','',3,0),(21,21,'category','',3,0),(22,22,'category','',3,1),(23,23,'category','',3,1),(24,24,'category','',3,1),(27,27,'category','',3,0),(28,28,'category','',4,1),(29,29,'category','',4,1),(31,31,'category','',4,0),(32,32,'category','',5,2),(33,33,'category','',5,1),(34,34,'category','',5,1),(35,35,'category','',5,0),(36,36,'category','',5,1),(37,37,'category','',5,0),(38,38,'category','',6,1),(39,39,'category','',6,1),(40,40,'category','',6,1),(41,41,'category','',6,0),(42,42,'category','',6,1),(43,43,'category','',6,0),(44,44,'category','',6,3),(45,45,'category','',6,1),(46,46,'category','',6,1),(47,47,'category','',0,1),(48,48,'category','',0,2),(49,49,'category','',0,1),(50,50,'category','',0,0),(51,51,'category','',0,1),(52,52,'category','',0,0),(53,53,'post_tag','',0,1),(54,54,'post_tag','',0,1),(55,55,'post_tag','',0,1),(56,56,'post_tag','',0,1),(57,57,'post_tag','',0,1),(58,58,'post_tag','',0,1),(59,59,'post_tag','',0,1),(60,60,'post_tag','',0,1),(61,61,'post_tag','',0,1),(62,62,'post_tag','',0,1),(63,63,'post_tag','',0,1),(64,64,'post_tag','',0,1),(65,65,'post_tag','',0,1),(66,66,'post_tag','',0,1),(67,67,'post_tag','',0,1),(68,68,'post_tag','',0,1),(69,69,'post_tag','',0,1),(70,70,'post_tag','',0,1),(71,71,'post_tag','',0,1),(72,72,'post_tag','',0,1),(73,73,'post_tag','',0,1),(74,74,'post_tag','',0,1),(75,75,'post_tag','',0,1),(76,76,'post_tag','',0,1),(77,77,'post_tag','',0,1),(78,78,'post_tag','',0,1),(79,79,'post_tag','',0,1),(80,80,'post_tag','',0,1),(81,81,'post_tag','',0,1),(82,82,'post_tag','',0,1),(83,83,'post_tag','',0,1),(84,84,'post_tag','',0,1),(85,85,'post_tag','',0,1),(86,86,'post_tag','',0,1),(87,87,'post_tag','',0,1),(88,88,'post_tag','',0,1),(89,89,'post_tag','',0,1),(90,90,'post_tag','',0,1),(91,91,'post_tag','',0,1),(92,92,'post_tag','',0,1),(93,93,'post_tag','',0,1),(94,94,'post_tag','',0,1),(95,95,'post_tag','',0,1),(96,96,'post_tag','',0,1),(97,97,'post_tag','',0,1),(98,98,'post_tag','',0,1),(99,99,'post_tag','',0,1),(100,100,'post_tag','',0,1),(101,101,'post_tag','',0,1),(102,102,'post_tag','',0,1),(103,103,'post_tag','',0,1),(105,105,'category','<h1><span style=\"color: #ff0000;\">Gia công mica:</span></h1>\r\nHùng Phát là công làm những sản phẩm gia công mica đẹp, mang lại hiệu quả cho chương trình marketing của mỗi doanh nghiệp. Với những sản phẩm đẹp bắt mắt, có giá trị sử dụng cao, ứng dụng trong nghành marketing, và có chi phí rất thấp.\r\n<h2>Sản phẩm gia công mica tại quảng cáo Hùng Phát:</h2>\r\n<strong>+ Menu mica để bàn (tent card)</strong>: sản phẩm này sử dụng trong nhà hàng, siêu thị diện máy, menu mica có nhiều loại khác nhau như menu mica chân chữ T, menu mica chân tam giác, menu mica chân chữ L. Về quy cách kích thước thì mỗi doanh nghiệp có thể đặt làm theo yêu cầu.\r\n\r\n<strong>+ Hòm phiếu ( hộp mica)</strong>: Hòm phiếu được sử dụng rộng rãi trong các cuộc bầu cử, hòm thư góp ý, hòm quyên góp, hòm góp ý, hòm từ thiện.\r\n\r\n<strong>+ Gia công kệ mica nhiều ngăn</strong>: Kệ đựng tờ rơi, kệ đựng sách, kệ đựng táp chí, kệ văn phòng. Những loại kệ này có dán kèm logo hình ảnh thương hiệu của mỗi doanh nghiệp khác nhau.\r\n\r\n<strong>+ Gia công sản phẩm mica khác:</strong> móc khóa mica, kệ điện thoại, kệ mỹ phẩm, kệ siêu thị, gia công mica theo yêu cầu\r\n<h2>Lý do nên chọn sản phẩm gia công mica của quảng cáo Hùng Phát:</h2>\r\n<ul>\r\n	<li>Giá luôn rẻ hơn</li>\r\n	<li>Chất lượng sản phẩm tốt</li>\r\n	<li>Gia công nhanh chóng, giao hàng đúng hẹn</li>\r\n	<li>Tư vấn tận tình dễ hiểu</li>\r\n	<li>uy tín - nhiệt tình</li>\r\n	<li>Thiết kế sáng tạo</li>\r\n</ul>\r\n<h3>Liên hệ Hotline để được tư vấn, và báo giá tốt nhất        <span style=\"color: #ff0000;\">091 588 65 333</span></h3>',0,0),(106,106,'category','',105,0),(108,108,'post_tag','',0,1),(109,109,'post_tag','',0,1);
